INSERT INTO `encyclopedias` (`id`, `country`, `state_name`, `slug`, `thumbnail`, `thumbnail_alt`, `banner_image`, `banner_image_alt`, `description`, `map_link`, `created_at`, `updated_at`) VALUES
	(3, 'India', 'Delhi', 'delhi', '1587534065_5e9fd8f19fccc.jpeg', NULL, '1587534065_5e9fd8f1a207e.jpeg', NULL, '<p><strong>About</strong></p><p>&nbsp;The national capital of the country, Delhi has its roots buried deep in Mughal history and has emerged with dynamic infrastructure. This metro city has got the best of both worlds with historic architectural wonders as well as quirky modern day hangout spots. With the mind-blowing places to visit and the overall homely vibe of the city, Delhi truly justifies itself as â€œDildaar Dilliâ€.&nbsp;</p><p><strong>Food&nbsp;</strong></p><p>Delhiâ€™s heart is on the streets of Delhi. Filled with heavy aroma of spices and stacked with varieties of yummy delicacies. Delhiâ€™s cuisine has got a bit of everything- Mughlai, Punjabi, Gujarati, Bengali, all international cuisines and the street food â€œchaatâ€. When in Delhi, hop around the famous foodie palaces. Go from the â€œparathasâ€ of Chandni Chowk to the momos of Amar colony and explore the wide range of international cuisines available at various cafes and have a party of your own.</p><p><strong>Culture</strong></p><p>Delhiâ€™s culture is a hotpot of many different boiling cultures. People from all over the country has contributed to the richness of Delhiâ€™s traditions in terms of festivals, dress codes, languages and art forms. Itâ€™ll be appropriate to say that Culture in Delhi&nbsp;is still holding its traditional values while getting flourished with modernization.&nbsp;&nbsp;</p><p><strong>Sightseeing</strong>&nbsp;</p><p>Delhi is the home of enchanted tombs and forts along with the national symbols and the modern hubs and museums.&nbsp;</p><p>Forts and tombs</p><ul><li>Safdarjung tomb</li><li>Red fort</li><li>Purana quila</li><li>Humayunâ€™s Tomb</li><li>Tughlakabad Fort</li></ul><p>Museums</p><ul><li>National Museum</li><li>National Rail Museum</li><li>Shankar\'s International Dolls Museum</li><li>National Gallery of Modern Art</li><li>Gandhi Smriti</li></ul><p>National spots</p><ul><li>India Gate</li><li>Rashtrapati Bhawan</li><li>Supreme Court of India</li><li>Jantar Mantar</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d448183.73907005717!2d76.81307299667618!3d28.646677259922765!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x390cfd5b347eb62d%3A0x37205b715389640!2sDelhi!5e0!3m2!1sen!2sin!4v1586256932544!5m2!1sen!2sin"  frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-07 13:50:22', '2020-04-22 11:11:05'),
	(4, 'India', 'Mahrastra', 'mahrastra', '1587534904_5e9fdc38021aa.jpeg', NULL, '1587534904_5e9fdc3804fab.jpeg', NULL, '<h4>About</h4><p>The dynamic state&nbsp;in the western peninsular region of India is the home of the Bollywood. From metropolitan wonders to historic world heritage sites, when in Maharashtra the possibilities are indeed, unlimited! Mumbai being the dazzling capital of the state, itâ€™s also known as the â€œcity of dreamsâ€. With shining presence of Bollywood on one side and heart-warming sceneries of the sea Mumbai is a wholesome experience. Marathis are known for their friendliest nature and being super helpful to everyone. They are proud of the lingo, the rap culture of the city and pretty much everything about the state.</p><p>&nbsp;</p><h4>Food</h4><p>From the world-famous&nbsp;pav bhaji&nbsp;to the delicious&nbsp;poha, Maharashtra has a lot to offer to foodies. Maharashtrian cuisine is broadly classified into two styles- Konkan and Varadi. Konkan being from the coastal region has influences from Goan, Saraswat, Gaud and Malvani regions. Varadi cuisine, on the other hand, belongs to the Vidarbha region. Maharashtrian food is tangy, spicy and definitely a treat for the taste buds. Some of the Maharashtrian soul foods are pav bhaji, vada pav, missal pav and bhel puri. Sweets play an important function in the Marathi plate. Modak, sreekhand and puran poli are some of them.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>Maharashtra as the name translates to â€œGreat Stateâ€ is extremely rich in culture and traditions. Be it the official language â€œMarathiâ€ spoken by the majority of locals or the folk music and dances like the Koli, Powada, Banjara Holi dance and Lavani dance all are very lively and colourful. The joyous and cheerful side of Maharashra can be seen in their vibrant festivals. Ganesh Chathurthi is an eleven-day long festival of Lord Ganesh celebrated throughout the state. The film industry contributes heavily to the culture of the state. Many famous actors and actresses like Amitabh Bachchan, Shah Rukh Khan, Salman Khan, Priyanka Chopra, Kareena Kapoor and Deepika Padukone, reside in this state.</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Ajanta caves</li><li>Ellora caves</li><li>Gateway of India</li><li>Elephanta caves</li><li>Lonavla</li></ul>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7736499.148433491!2d72.27657125898781!3d18.771954772859896!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bcfc41e9c9cd6f9%3A0x1b2f22924be04fb6!2sMaharashtra!5e0!3m2!1sen!2sin!4v1587535883229!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-07 17:13:08', '2020-05-01 16:46:38'),
	(10, 'India', 'Tamil Nadu', 'tamil-nadu', '1587528415_5e9fc2df0d47f.jpeg', NULL, '1587528415_5e9fc2df10016.jpeg', NULL, '<h4>About</h4><p>The enchanting state of palm trees and beaches is the perfect blend of tranquility and metropolitan. Tamil Nadu is known for its&nbsp;Dravidian-style Hindu temples, many breath-taking tourist attractions, auspicious culture and mind gobbling cuisine.&nbsp;The long coastline, touching the tip of the country and the fabulous hill stations make Tamil Nadu famous. Other than the beauty of the land and sea, Tamil Nadu is what Tamils make it. Tamils are proud and dignified locals, keeping the Dravidian culture alive and nurtured.&nbsp;&nbsp;<br><br>&nbsp;</p><h4>Food</h4><p>Tamil cuisine can be garnished as healthy, tangy and unique. Spicy curries served with rice and flavorful chutneys. Tamil cuisine offers a wide range of interesting munchies and snacks. Like, the uttapam, sweet banana bonda, murukku classic south Indian filter kaapi and medhu vada.&nbsp; Some of the vegetarian delights to partner your rice can be the aromatic rasam, traditional rasam with vegetable poriyal and a cruchy side of papadam. And lastly, to finish the meal right, go for some tummy-warming payasam, traditional bowl of goodness- pongal.</p><p>&nbsp;</p><h4>Culture</h4><p>Hinduism and the deep mythological beliefs of the people heavily influence Tamil Naduâ€™s culture. This includes vibrant festivals some of which includes large chariots decorated with religious icons are taken in procession around the temple. Tamil Naduâ€™s&nbsp;<a href="https://www.britannica.com/art/bharata-natyam">Bharata natyam</a>, one of Indiaâ€™s major classical dance forms and harmonious Karnatak music is also widely practiced. The charming smiles of Tamil people are beautifully accessorized with their traditional costumes. For women, sari finds immense significance in the traditional clothing in Tamil Nadu. Lungi is the most common bottom-wear for men with angavastram, a piece of cloth wrapped around the shoulders.</p><p>&nbsp;</p><h4>Sightseeing</h4><h4>Temples</h4><ul><li>Meenakshi Amman Temple</li><li>Shore Temple</li><li>Brihadeeswara Temple</li><li>Ekambareswarar Temple</li></ul>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4013192.775893667!2d76.04399960232978!3d10.801080431880244!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3b00c582b1189633%3A0x559475cc463361f0!2sTamil%20Nadu!5e0!3m2!1sen!2sin!4v1587529612772!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 09:36:55', '2020-04-27 17:08:12'),
	(11, 'India', 'Madhya Pradesh', 'madhya-pradesh', '1587533295_5e9fd5efb6e30.jpeg', NULL, '1587533295_5e9fd5efb999c.jpeg', NULL, '<h4>About</h4><p>Madhya Pradesh-the heart of incredible India. The central state of the country is richly packed with landmarks from eras throughout the Indian history. Itâ€™s a state of vivid culture, hill stations, and rich wildlife experiences. From beautiful temples to intricate art &amp; craft, sprawling landscapes to varied wildlife, the state has everything to offer. Being rich in mineral resources, Madhya Pradesh is the largest producer of many valuable minerals such as diamond and copper. With its beautiful attractions and even more beautiful people and culture, Madhya Pradesh truly justifies being the heart of India.&nbsp;</p><p>&nbsp;</p><h4>Food</h4><p>The cuisine of Madhya Pradesh is a mouth-watering buffet of traditional dishes representing different cultures of India. This cuisine has delicious options for both vegetarian and non-vegetarian foodies. This state takes their breakfast seriously! Poha, jalebi, palak puri are some of the beloved breakfast specials. Next, like Lucknow is to Uttar Pradesh, Bhopal is to Madhya Pradesh. Offering the best, mughlai meat delicacies like the finger-licking seekh kebab, Bhoplali gosht korma and biryani with the impeccable â€œzardaâ€. The heart of the country surely takes care of the sweet tooth of the countrymen. Some of their delightful desserts include, malpua, jalebi and the traditional mawa bati, unique to Madhya Pradesh.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>Madhya Pradesh is a culturally vibrant and colorful state. The people of Madhya Pradesh are said to follow the highest flavors of culture and tradition with pride and dignity. Itâ€™s the land of joyous festivals, traditional folk dance and music and very unique art and craft. A number of festivals are celebrated in Madhya Pradesh. An important tribal festival is Bhagoriya marked by traditional gaiety and enthusiasm.&nbsp;The beauty of the traditions of this state can be witnessed through the local costumes. Dhoti forms the traditional costume of men accompanied by the turban known as the â€œsafaâ€.&nbsp; Lehenga-choli and saree are common for the women.&nbsp;</p><p>&nbsp;</p><h4>Sightseeing&nbsp;</h4><ul><li>Bhandhavgarh National Park</li><li>Kanha National Park</li><li>Pench National Park</li><li>Panna National Park</li><li>National parks</li><li>Sanchi Stupa</li><li>Gwalior Fort</li><li>Khajuraho</li><li>Historical places</li><li>Ancient temples of Ujjain</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7470010.487917254!2d73.92783738306477!3d23.908545264787303!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39667381d35aea05%3A0xe0106b0d4e701c1e!2sMadhya%20Pradesh!5e0!3m2!1sen!2sin!4v1587534439598!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 10:58:15', '2020-04-27 11:00:47'),
	(12, 'India', 'Assam', 'assam', '1587533579_5e9fd70b5407f.jpeg', NULL, '1587533579_5e9fd70b55ff9.jpeg', NULL, '<h2>About</h2><p>The northeastern state of Assam is known for its flourishing wildlife, archeological sites and the best tea plantations.&nbsp;Assam is the largest and most accessible of the Northeast States. The archetypal Assamese landscape is a golden-green panorama of rice fields and manicured tea estates, framed by the blue mountains of Arunachal Pradesh in the north and the highlands of Meghalaya and Nagaland to the south. The birthplace of Indian tea, Assam has more than 3000 sq. km of land carpeted in bright-green tea gardens.&nbsp;</p><p>&nbsp;</p><h2>Food</h2><p>The Assam cuisine has a distinct flavour that is marked by Bengali influence and consists of a delicate taste that would make anyone go gaga. This cuisine experiences the choicest of herbs and fresh fruits and vegetables for the dishes.</p><p>Assamese cuisines use many ingredients like fish, bamboo shoots, fiery bhoot, Jolokia chilly and various types of meats. Assamese cuisine wonders may include, khaar, duck meat curry, oou khatta and aloo pitika. Due to the Bengali influence on the cuisine, desserts are of great importance. Guroor payash, rava laddoo and kamolar kheer are some of them.</p><p>&nbsp;</p><h2>Culture</h2><p>Assam is known for its rich culture and diverse population. The culture of Assam is a fusion of Indo Burmese, Mongolian and Aryan influences. The beautiful land is a little paradise on a rocky terrain and worth to be discovered for its pristine beauty. The natives are called Asomiya, which is also the state language of&nbsp;<a href="https://www.holidify.com/state/assam">Assam</a>. Classical Assamese music is divided into Borgeet and Ojapali which combines narrative singing with dancing. The music of Oja-pali has a raga system of clear traditional orientation. The Assamese adorn very simple dresses, and mostly hand loomed. The women wear motif-rich Mekhela Chador or Riha- Mekhela.&nbsp;Assam with its ecstatic frenzy has always enraptured its visitors and never left them disappointed.</p><p>&nbsp;</p><p>Sightseeing</p><ul><li>Kaziranga National Park</li><li>Kamakhya Temple</li><li>Umananda Temple</li><li>Assam State Museum</li></ul><p>Peacock island</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3670808.5058388566!2d90.6067283575828!3d26.040951891653165!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x374516c94c312d63%3A0xd11a73bb736719fb!2sAssam!5e0!3m2!1sen!2sin!4v1587534696206!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 11:02:59', '2020-10-03 07:26:25'),
	(14, 'India', 'Haryana', 'haryana', '1587542918_5e9ffb8642728.jpeg', NULL, '1587542918_5e9ffb864460d.jpeg', NULL, '<h2>About</h2><p>Haryana:&nbsp;<em>the land of milk, hooka &amp; khaat</em>. Haryana can be summarized as rich agricultural fertility, history of Panipat battles and blooming sportspersons. With its traditions held high and buried deep, Haryana is also one of the wealthiest states of India having largest industries in terms of automobiles. Haryanvis are humans of kindness and bravery. Feel the hospitality and warmness and enjoy a cup of fresh milk as Haryanvis greet you into their homes.</p><p>&nbsp;</p><h2>Food</h2><p>Haryanaâ€™s cuisine is mostly a vegetarian one, and when it comes to dairy products like milk and ghee, the more the merrier. In fact, many locals make their butter and ghee at home, which adds that freshness and love in their food. Famous staples of Haryana includes tempting Singri ki sabzi, spicy Hara Dhania Choliya, and a mind gobbling variety of â€œRotiâ€, no wonder Haryana is referred to as \'The Land of Rotis". And lastly the scrumptious deserts like the sugar syrup dipped Malpua and the traditional custard- Raabri.</p><p>&nbsp;</p><h2>Culture</h2><p>Haryanaâ€™s culture is very unique and fascinating. Popularly known as \'The Home of Gods\', this vibrant state has a bountiful culture, heritage, festivals, folklores and a vibrant landscape. The folk art like the folk dance and theatre are both colourful and engrossing, depicting day-to-day images. Haryanvi music is a lively treat to the ears often with humour tweaked in. The rich culture can be beautifully witnessed through the ensemble of the locals; bright â€œpagrisâ€ on men and women wearing flared long skirts called â€œdaamanâ€. In Haryana experience the sunshine of culture and heritage.</p><p>&nbsp;</p><h2>Sightseeing</h2><p>Forts and palaces</p><ul><li>Begum Samru Palace</li><li>Farrukh Nagar Fort</li><li>Badshahpur Fort</li><li>Raja Nahar Singh Palace</li><li>Feroze Shah Palace</li></ul><h2>&nbsp;</h2><h2>Museums and gardens</h2><ul><li>The Rock Garden</li><li>International Dolls Museum</li><li>Rose garden</li><li>Stellarâ€™s Children Museum</li><li>Panipat Museum</li></ul>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3564152.6753353057!2d73.78269260050354!3d29.264183528638938!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x390db00b8670400b%3A0x732eaab4aaa6c143!2sHaryana!5e0!3m2!1sen!2sin!4v1587543929155!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 13:38:38', '2020-10-03 07:28:07'),
	(15, 'India', 'West Bengal', 'west-bengal', '1587543244_5e9ffccc0d661.jpeg', NULL, '1587543244_5e9ffccc0ff47.jpeg', NULL, '<h4>About&nbsp;</h4><p>the eastern state with Bay of Bengal kissing its feet is truly a gem of India. West Bengal is the home of the finest laureates of our country like Rabindranath Tagore and Satyajit Ray, and embraces the rich literature in all its glory.&nbsp; West Bengal prominently represents the British era with its city plans, architecture and overall colour schemes. West Bengal is a steaming hotpot of metropolitan hustle bustle as well as serene nature escapes. From Victorian times aesthetics to football mania, West Bengal has it all.</p><p>&nbsp;</p><h4>Food</h4><p>West Bengal is known for its delicious and unique cuisine and Bengalis are known for their obsession for the same. This cuisine offers a platter of seafood, prepared with magic and different curries with a side of â€œbhaatâ€ (rice). The unsaid love for non-vegetarian delicacies can be seen in the yummy dishes like Kosha mangsho (slow cooked mutton), chicken biryani and again seafood! And they do not lack in scrumptious vegetarian dishes as well, like dal, aloo posto, beguni are local staples. One cannot mention West Bengal without talking about sweets. The list will go like, roshogolla, chom-chom, sandesh, kachagolla and several such drops of heaven.</p><p>&nbsp;</p><h4>Culture</h4><p>Bengali culture is all about warmth and smiles. Be it their official language â€œBanglaâ€, different kinds of music, beautiful motion movies, colourful festivals or their overall cheerful lifestyle. Their vibrant culture can be observed beautifully during Durga Puja, a 4 day long festival celebrated every year with immense enthusiasm. Bengali literature and poetry is popular and appreciated worldwide. Songs written by Rabindranath Tagore known as â€œRabindra Sangeetâ€ are the harmony in every Bengali household. The bright hues of the Bengali culture can also be seen through the ethnic local wear. â€œLaal paar shaada sareeâ€ translated, as red-bordered white saree is the symbol of holiness and purity and is worn on auspicious occasions.</p><p>&nbsp;</p><h4>Sightseeing</h4><p>ï‚·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Victoria Memorial</p><p>ï‚·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Howrah Bridge</p><p>ï‚·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Indian Museum</p><p>ï‚·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Belur Math</p><p>ï‚·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Science city</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3721951.794652998!2d85.60643076854124!3d24.356294886263136!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39fa16ff1397e887%3A0x71543a3dc3e7a20a!2sWest%20Bengal!5e0!3m2!1sen!2sin!4v1587544430056!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 13:44:04', '2020-04-22 13:44:04'),
	(16, 'India', 'Kerala', 'kerala', '1587543632_5e9ffe50160f4.jpeg', NULL, '1587543632_5e9ffe5018d7f.jpeg', NULL, '<h4>About</h4><p>The lush green valleys, tranquil backwaters and vibrant culture makes Kerala truly the Godâ€™s own country. Situated on the southwestern Malabar Coast of India, the state is heavily Portugal inspired in architecture with a profound history of literature and art. Apart from this, Kerala is the top producer of cash crops such as pepper, coffee and cashew. With the highest literacy rate in India, keralites are humble and intellectual with a deep sense of belongingness with the nature.</p><p>&nbsp;</p><h4>Food</h4><p>Keralaâ€™s cuisine can be defined as wholesome, fresh and satisfying. This cuisine has a wide range of both vegetarian and non-vegetarian delicacies prepared in aromatic and strong spices. Rice is the star of the cuisine and is consumed at all times. Some of the famous dishes may include spicy beef curry and porotta, idli, rasam and delicious biryani. One canâ€™t get enough of snacks when in Kerala, be it banana chips, appam or the famous vada. And for the sweet tooth, warm payasam and banana halwa are the common delicacies.</p><p>&nbsp;</p><h4>Culture</h4><p>The culture of Kerala is composite and cosmopolitan in nature and it is an integral part of&nbsp;<a href="https://en.wikipedia.org/wiki/Indian_culture">Indian culture</a>. The sparkling culture of Kerala can be seen and experienced through the vibrant festivals, rich literature and elegant art forms. Mollywood has paved its way through with dynamic and award winning performances and movies. The official language of Kerala- Malayalam is one the classical languages in India. The holy festival of Onam is widely celebrated in the entire state throughout a period of 7 days. The beauty of Keralaâ€™s culture can also be witnessed by the golden aesthetics of their clothing and jewelry. The culture and beauty of Kerala just blends in seamlessly.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h4>Sightseeing&nbsp;</h4><ul><li>Backwaters of Alleppey</li><li>Mattacherry palace</li><li>Napierâ€™s museum</li><li>Kovalam beach</li></ul><p>Munnarâ€™</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4016734.7527726707!2d73.88381004802422!3d10.532724200376261!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3b0812ffd49cf55b%3A0x64bd90fbed387c99!2sKerala!5e0!3m2!1sen!2sin!4v1587544699418!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 13:50:32', '2020-04-22 13:50:32'),
	(17, 'India', 'Gujarat', 'gujarat', '1587543827_5e9fff13c1be8.jpeg', NULL, '1587543827_5e9fff13c3e39.jpeg', NULL, '<h2>About</h2><p>The home of Mahatma Gandhi, Gujarat is the state of color, love, excellence, business and extravagance. It is knows for its rich history, culture and heritage dating back thousands of years. It is home to numerous temples, mosques, and other historical monuments beautifully going back in time and shedding light on its glorious heritage. It is dotted with several natural wonders like the Rann of Kutch, which is the largest salt desert in the world. And when in Gujarat, surround yourself with&nbsp;unique folk dances and some lip-smacking dishes of the state well known all over the world.</p><h2>Food</h2><p>Gujarat has a distinct flavour to their food and their use of whole spices stands out the most. The state is also a predominantly vegetarian state, so most of the delicacies belong to that category. Gujarat uniquely combines the sweet and savoury tastes into the same dish. In&nbsp;Gujarati Food&nbsp;a wholesome meal gets a priority. Some of the famous savoury Gujarati snacks include dhokla, khakra, thepla and khandvi. And some delightful Gujarati desserts will be basundi, malpua and halvasan.&nbsp;</p><p>&nbsp;</p><h2>Culture</h2><p>The Gujaratis are known fir their diverse and vibrant cultural heritage and rich traditions. Gujarati folk music, known as&nbsp;Sugam Sangeet, is a hereditary profession of the&nbsp;<a href="https://en.wikipedia.org/wiki/Barot_(caste)">Barot</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Gadhvi">Gadhvi</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Charan">Charan</a>&nbsp;communities. Accompanied with the upbeat folk dance â€œgabraâ€ performed on auspicious festivals like the navratri and is a colourful wonder. Other than this&nbsp;<a href="https://en.wikipedia.org/wiki/Makar_Sankranti">Makar Sankranti</a>&nbsp;is a festival when the sky turns into a rainbow of kites. The&nbsp;traditional Gujarati dresses for men include&nbsp;kediyu or kurta&nbsp;on the top and&nbsp;dhoti or chorno&nbsp;at the bottom.&nbsp;Women in Gujarat wear&nbsp;sarees&nbsp;or&nbsp;chaniya choli<em>.</em>&nbsp;Gujarat is truly a vibrant state.&nbsp;</p><p>&nbsp;</p><h2>Sightseeing</h2><ul><li>Gir national Park</li><li>Somnath Temple</li><li>Sabarmati Ashram</li><li>Rani Ki Vav</li><li>Statue of unity</li></ul><p>Lakshmi Vilas Palace</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7557063.895685169!2d66.82414256443764!3d22.354663222353526!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3959051f5f0ef795%3A0x861bd887ed54522e!2sGujarat!5e0!3m2!1sen!2sin!4v1587545034509!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 13:53:47', '2020-10-03 07:27:36'),
	(18, 'India', 'Uttarakhand', 'uttarakhand', '1587544022_5e9fffd6172f6.jpeg', NULL, '1587544022_5e9fffd619339.jpeg', NULL, '<h4>About</h4><p>Uttarakhand is simply heaven on earth. The pleasant state is known for its&nbsp;natural beauty of the Himalayas, the Bhabhar and the Terai grasslands and savannas. Uttarakhand is often referred as the Devbhumi or Land of the Gods due to the many Hindu temples and pilgrimage center. With the beauty in its sceneries, the people of Uttarakhand, known as Uttarakhandi our precious solus as well. With tremendously rich culture and unique folklore, Uttarakhand feels like a enchanted fairytale and a warm home at the same time.</p><p>&nbsp;</p><h4>Food</h4><p>The cuisine of Uttarakhand is similar to its people, simple yet incredible. The two distinct regions, Kumaon and Garhwal offer palates of flavoursome dishes that are highly nutritional as well. The food habit in the state shifts with the changing season; where in winter in Mathir and Til Laddus or Madua Rotis are preferred, in summers, Dubkas with Chholia Rotis are relished. Some traditional heart-warming delicacies include Aaloo Gutuk, Dubke, Thathwani, Kaapa, Chudkani, Jaula and Sisunaak Saag. Uttarakhand is also known for its interesting and mouth-watering sweet wonders like the Bal mithai, singori and arsa.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>The culture of Uttarakhand still revolves around its traditional ethics, moral values, the simplicity of nature and a rich mythology.&nbsp;The state is amongst one of the most historically affluent places in India with Dravidians, Indo-Aryan descents and Nordic races being a part of its ethnicity.&nbsp; Like Uttarakhandiâ€™s simple lifestyle, the festivals and fairs in Uttarakhand are also simple yet culturally rich. Each season is welcome with hearty folk songs and dance and so are the agricultural periods. With folk dances like, Barada Nati and Bhotiya Dance. The humble people of Uttarakhand take immense delight in celebrating even a small success with a grateful heart.</p><p>&nbsp;</p><h4>Sightseeing&nbsp;</h4><ul><li>Rajaji National Park</li><li>Nainital Lake</li><li>Valley of flowers National Park</li><li>Laxman jhula</li><li>Roop Kund</li><li>Badrinath Temple</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3535951.3703282624!2d77.06782105280142!3d30.063312643264485!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3909dcc202279c09%3A0x7c43b63689cc005!2sUttarakhand!5e0!3m2!1sen!2sin!4v1587545214579!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 13:57:02', '2020-05-01 16:06:04'),
	(20, 'India', 'Andhra pradesh', 'andhra-pradesh', '1587544774_5ea002c641754.jpeg', NULL, '1587544774_5ea002c643704.jpeg', NULL, '<h2>About</h2><p>Andhra Pradesh, the state of three majestic physiographic regions: the coastal plain to the east, extending from the Bay of Bengal to the mountain ranges; the mountain ranges themselves, the Eastern&nbsp;<a href="https://www.britannica.com/place/Ghats">Ghats</a> and, in the southwest, the plateau to the west of the Ghats.&nbsp;Andhra Pradesh has the perfect concoction of various communities, religions, customs, lifestyles and cultures. In broad terms, the people of Andhra are nice and friendly, who live in perfect harmony, in spite of belonging to different castes and following different religions. The vivid culture and traditions of the state, truly makes it the essence of Incredible India.&nbsp;</p><p>&nbsp;</p><h2>Food</h2><p>Andhra Pradesh&nbsp;is known for its aromatic and spicy food all around the country. The inspiration behind such delicious variations of delicacies lies in the opulent culture of the state, where exotic food is being prepared in the kitchen of the Nawabs since the year of its origin. The Andhra cuisine comprises of both mouth-watering vegetarian and non-vegetarian dishes. Some of the renowned dishes include the culinary wonder- Hyderabadi Biryani, prepared with exotic spices and tender meats. The traditional&nbsp;Pulihora or the tamarind rice, punugulu the perfect rainy day snack and a yummy-yummy range of sweets, rava laddoo, bobbatlu and ariselu.&nbsp;</p><p>&nbsp;</p><h2>Culture&nbsp;</h2><p>Andhra Pradesh, also known as the Rice Bowl of India is like a melting pot of varied cultures.&nbsp;The rich&nbsp;cultural&nbsp;heritage of&nbsp;Andhra Pradesh&nbsp;is evident from the internationally renowned Carnatic music. The region is home to some of the most popular classical musicians like Thyagaraja and Annamacharya.&nbsp;The local language of the region, Telegu is an extremely intense language and many compositions and poems have been written in this language. Traditionally,&nbsp;the&nbsp;Andhra Pradesh&nbsp;Women wear the&nbsp;traditional dresses&nbsp;are Sari and Blouse, and the men wear Dhoti and Kurta.&nbsp;</p><p>&nbsp;</p><p>Sightseeing</p><ul><li>Sri Venkateswara Swamy Vaari Temple</li><li>Belum caves</li><li>Talakona</li><li>Undavalli caves</li><li>Rushikonda beach</li><li>INS Kursura S20</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7860550.265032457!2d76.26570360051674!3d15.84822218337502!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3a3546f8ae93d47f%3A0x33d1bbbe95adcd83!2sAndhra%20Pradesh!5e0!3m2!1sen!2sin!4v1587545863726!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 14:09:34', '2020-10-03 07:26:02'),
	(21, 'India', 'Karnataka', 'karnataka', '1587545134_5ea0042e5e7c2.jpeg', NULL, '1587545134_5ea0042e6128e.jpeg', NULL, '<h4>About</h4><p>Formerly known as Mysore, Karnataka is the silicon valley of India. The capital city of Bengaluru is the blooming IT hub of the country. Other than this, Karnataka is the home of scenic coastal plains, subtle hill ranges and the royal Karnataka plateau.</p><p>The beauty of Karnataka can be seen through the humble nature of the local people, most of Karnatakaâ€™s people are considered to be the descendants of the so-called Dravidian population of&nbsp;<a href="https://www.britannica.com/place/India">India</a>. Stretching from rich cultures to vast tech abundance, Karnataka is one state many worlds.&nbsp;</p><p>&nbsp;</p><h4>Food</h4><p>Karnatakaâ€™s cuisine takes influence from its neighbors like Kerala, Andhra Pradesh, Tamil Nadu and Maharashtra. However, the variety of flavors changes from region to region. Mangalore and North Karnataka are famous for their tangy seafood. South Karnataka is known for various types of Bath. North Karnataka food is much spicier in comparison to the other parts of Karnataka. Food grains such as ragi, rice, jower, urad dal and semolina are some staples. Palm jaggery is also an important ingredient in Karnatakaâ€™s cuisine. The mouth-watering list of Karnataka food will surely include neer dosa, Mysore masala dosa and korri gassi. Ending it right with scrumptious desserts like the Mysore pak, haalbai and rava kesari.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>From its exuberant art and culture of multilingual ethnicity, astounding dance forms, mesmerising music, sophisticated heritage, zealous festivities, elegant clothing and delectable cuisine&nbsp;<a href="https://www.holidify.com/state/karnataka">Karnataka</a>&nbsp;has a plethora of historical secrets, interwoven within a rich and varied culture.&nbsp;Karnataka is home to 50 different tribes, each having their traditions and customs, hence making Tribal art an indigenous art form. The annual buffalo race, a two-day festival, is an integral part of the rural community and is considered a sport as well as a tradition. In Karnataka, the attires vary from district to district; Ilkal sarees are one of the popular traditional attires of women in Karnataka.</p><p>&nbsp;</p><p>&nbsp;</p><h4>Sightseeing&nbsp;</h4><ul><li>Mysore Palace</li><li>Lalbagh Botanical garden</li><li>Jog Falls</li><li>Bangalore Palace</li><li>Virupaksha Temple</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3946245.846920517!2d74.07447179819916!3d15.006260058237041!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3ba35a4c37bf488f%3A0x41f1d28cd1757cd5!2sKarnataka!5e0!3m2!1sen!2sin!4v1587546313719!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 14:15:34', '2020-04-22 14:17:59'),
	(23, 'India', 'Jammu and Kashmir', 'jammu-and-kashmir', '1587545575_5ea005e7ab32e.jpeg', NULL, '1587545575_5ea005e7ad39e.jpeg', NULL, '<h4>About</h4><p>Jammu and Kashmir is truly a piece of heaven on India.&nbsp;The natural beauty and picturesque locations have made it a favored destination for tourists across the world. The enchanted state shares its borders Himachal Pradesh and Punjab, and the neighboring countries of Pakistan, China and Afghanistan. The summer capital being Jammu and winter capital Srinagar, the state is a beautiful journey on its own. Jammu is famous for its temples, while the Kashmir Valley is known for its lakes and gardens.&nbsp;</p><p>&nbsp;</p><h4>Food</h4><p>Kashmir is heaven, not only in terms of landscapes but for foodies too. Kashmiri cuisine is varied and flavorsome. Mughals and Arabs heavily influence it and it can be seen in the spicy dishes. But many of the dishes have a signature of Kashmiri pundits on them. Kashmiris are known for their crazy love for mutton and their many different and unique ways of preparing mutton. Though this does not mean Kashmir food hasless of vegetarian options. Some of the drool-worthy Kashmiri dishes are rogan josh, dum olav, yakhni lamb curry and Kashmiri baingan. And when in Kashmir, enjoy the view with the traditional drink, kahva.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>Jammu Kashmir is a diverse blend of various cultures. People from different religious and social practices of Muslim, Hindu, Sikh, and Buddhist have created a composite culture of the state, which is called Kashmiriyat.&nbsp;Costumes of Jammu and Kashmir are well known for their embroidery and intricate designs, which reflects the richness of the culture and landscape of the region. The Dumhal is a famous dance in the Kashmir valley, performed by men of the Wattal region. The women perform the Rouff, another traditional folk dance. Jammu and Kashmir is a cultural crown on Indiaâ€™s head.&nbsp;</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Doodhpathri</li><li>Dal lake</li><li>Pangong Tso</li><li>Bahu Fort</li><li>satsar Lake</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3391930.983166734!2d74.28458259773184!3d33.878510880194916!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38e1092499ffa89d%3A0x6567a6d4697e7f1!2sJammu%20and%20Kashmir!5e0!3m2!1sen!2sin!4v1587546766773!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 14:22:55', '2020-04-22 14:22:55'),
	(24, 'India', 'Andaman and Nicobar', 'andaman-and-nicobar', '1587546044_5ea007bcea6ef.jpeg', NULL, '1587546044_5ea007bcec5d2.jpeg', NULL, '<h2>About</h2><p>The cluster of 300 islands floating on the Bay of Bengal is the tropical getaway for everyone.&nbsp; Known for their palm-lined, white-sand beaches, mangroves and tropical rainforests. Andaman and Nicobar islands hold a rich pre-independence history of the country. With architectural wonders like the cellular jail located in the capital city, Port Blair. Coral reefs supporting marine life such as sharks and rays make it heaven for adventure seekers and is for popular diving and snorkeling sites. And what makes it even more interesting is the fact that&nbsp;the Islands are home to the&nbsp;<a href="https://en.wikipedia.org/wiki/Sentinelese_people">Sentinelese people</a>. The Sentinelese are the only people currently known to not have reached further than a&nbsp;<a href="https://en.wikipedia.org/wiki/Paleolithic">Paleolithic level of technology</a>.</p><p>&nbsp;</p><h2>Food</h2><p>Andaman &amp; Nicobar Islands is a fusion of Indian Culture. This is even reflected in the food &amp; Cuisine of the local peoples of these Islands. Andaman cuisine is heavily influenced by all the cultures that came into contact with the region. Being a tropical state, fresh fruits and vegetables are a prominent part of the cuisine. One can find Mangoes, Bananas, Pineapples, Guava and a lot more or drink in the absolutely revitalizing and also exotic coconut water. Some of the local staples are chilli curry, coconut prawn curry and barbeque seafood like lobster, prawns and crabs.&nbsp;</p><p>&nbsp;</p><h2>Culture</h2><p>Andaman and Nicobar islands is a vibrant spectrum of culture. Influenced my various other cultures inhabited by the land.&nbsp;Not only the beauty of nature and the various&nbsp;enticing features but also the peace-loving people have made the Andaman and Nicobar&nbsp;Islands a tourist spot for visitors overseas. Celebrating a wide range of cultural and intellectual festivals with immense enthusiasm like the Subhash Mela and Island Tourism Festival in January, Beach Festival in April, Monsoon festival in August, Food festival and world tourism day celebration in September and film festival in November.</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Cellular jail</li><li>Viper island</li><li>Radhanagar beach</li><li>Mahatma Gandhi Marine National park</li><li>North Bay Island</li><li>Barren Island</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4020905.2920951354!2d91.00582723125012!3d10.207809888117476!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3064a00f2b650ff3%3A0xce80055648fccb2c!2sAndaman%20and%20Nicobar%20Islands!5e0!3m2!1sen!2sin!4v1587547207081!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 14:30:45', '2020-10-03 07:25:32'),
	(25, 'India', 'Puducherry', 'puducherry', '1587546362_5ea008faac53d.jpeg', NULL, '1587546362_5ea008faae4ef.jpeg', NULL, '<h4>About</h4><p>If someone wants to have a relaxed weekend by the beach, sipping margaritas and having something French, Puducherry is the place to be. With the area of&nbsp;483&nbsp;km2, Puducherry is a small, French-colony themed, colourful city. When in Puducherry, one can live the historic times, surrounded by bright coloured old buildings and soothing beach waves. One of the must-visit beaches is the Promenade beach, strong waves crashing on the shore, which is a blanket of big black rocks. Sitting on the rocks as the waves crumbles over oneâ€™s feet and the winds gushes through oneâ€™s hair.&nbsp;</p><p>&nbsp;</p><h4>Food</h4><p>The scrumptious cuisines of Pondicherry have a great French as well as Tamil influence. Housing the best French Cafes in India, Pondicherry is a foodie\'s paradise and is a great place to try out new gourmet cuisines from around the world. One thing that can make Pondicherry cuisine stand different from any other food to try is the common practice that is followed by the locals when preparing food. Food in Pondicherry is cooked in very less oil and is easy to digest. Be it a South Indian or a French cuisine; global cafes, or vegan chocolates, the place is sure to satisfy your appetite. Some mouth-watering Puducherry specials are, Kadagu Yerra, quiche, Assad, Coconut Curry, Podanlangkai, Curried and Stuffed Vegetables. And to end it right, the tummy warming palpayasam.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>Puducherry culture is very rich and diverse. It is place where the cultural impacts of several traditions have merged to form a culture of itself.&nbsp; Puducherry people speak&nbsp;French&nbsp;and English, along with Tamil, Telugu and Malayalam. When it comes to the music and dance forms, it is a very visible form of extension of the southern styles of classical music and dance. Some of the important arts and crafts products of Puducherry include attractively crafted dolls and toys made from hard, unglazed, brownish-red earthenware or plaster and bronze.</p><p>&nbsp;</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Promenade beach</li><li>Sri Aurobindo Ashram</li><li>Pondicherry Museum</li><li>Rock beach</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d62456.81847266243!2d79.77850845341563!3d11.936293134404558!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3a5361ab8e49cfcf%3A0xcc6bd326d2f0b04e!2sPuducherry!5e0!3m2!1sen!2sin!4v1587547573163!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 14:36:02', '2020-04-27 17:31:20'),
	(26, 'India', 'Goa', 'goa', '1587546530_5ea009a24b55c.jpeg', NULL, '1587546530_5ea009a24df05.jpeg', NULL, '<h4>About</h4><p>Goa is the smallest state on the Western coast of India with coastlines along the majestic Arabian Sea. The Portugal inspired state is one of the most popular holiday destinations in the world. Goa is the home of exotic sandy beaches, picturesque forts and glorious basilicas. Along with the vibrant culture of the state itâ€™s also appreciated for the dazzling festivals and the all-time celebration aura. When in Goa, immerse yourself in the colorful and lively city paths, spicy tropical cuisine and the hearty humble locals of Goa.</p><p>&nbsp;</p><h4>Food</h4><p>The cuisine of Goa has been shaped by the conflux of various cultures over the years. The end result has been a fiery, lip-smacking and authentic Goan cuisine. This cuisine is characterized by its hearty use of spices and condiments, which is quite natural, considering the fact that this state falls under a tropical climate. Some of the standard ingredients used in Goan cuisine are rice, fish, seafood, meat, vegetables and coconut. Kokum (a kind of fruit) is another ingredient, which is present in nearly all the dishes of this region.&nbsp; Some of the finger-licking Goan dishes are prawn balchao, Goan fish curry, chicken xacuti and pork sorpotel. With the party always on, Goans know their sweets. Bebinka, dodol and doce are some of the wholesome treats.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>People living in Goa are referred to as Goans. Goans have taken the best of both worlds, a wonderful harmonization between East and West. Goanâ€™s celebrate all major festivals without imposing any religious barriers within society thereby adopting their old traditions and customs.&nbsp;The costumes of the womenâ€™s in Goa include the 9-yard sari. It is also known as the â€˜ Pano Bhaju â€˜ and some&nbsp;Goan traditional&nbsp;jewelry, to balance the whole costume. The flexibility in their customs is due to the fact that different empires were reining the place and the customs molded over the period of time.</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Aguada fort</li><li>Anjunna beach</li><li>Basilica of Bom Jesus</li><li>Se cathedral</li><li>Chapora fort</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d492485.5348693648!2d73.73211268567827!3d15.34703808697148!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bbfba106336b741%3A0xeaf887ff62f34092!2sGoa!5e0!3m2!1sen!2sin!4v1587547747290!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 14:38:50', '2020-04-22 14:38:50'),
	(27, 'India', 'Jharkhand', 'jharkhand', '1587546820_5ea00ac49bad7.jpeg', NULL, '1587546820_5ea00ac49d983.jpeg', NULL, '<h4>About</h4><p>The name "Jharkhand" means "The Land of Forests". &nbsp;Jharkhand is an eastern state of India, known for its glorious waterfalls, the elegant Jain temples and the enchanted wildlife of Beta National Park. Jharkhand is bordered by the states of&nbsp;<a href="https://www.britannica.com/place/Bihar">Bihar</a>&nbsp;to the north,&nbsp;<a href="https://www.britannica.com/place/West-Bengal">West Bengal</a>&nbsp;to the east,&nbsp;<a href="https://www.britannica.com/place/Odisha">Odisha</a>&nbsp;to the south,&nbsp;<a href="https://www.britannica.com/place/Chhattisgarh">and Chhattisgarh</a>&nbsp;to the west, and&nbsp;<a href="https://www.britannica.com/place/Uttar-Pradesh">Uttar Pradesh</a>&nbsp;to the northwest. Its capital is&nbsp;the tranquil city,&nbsp;<a href="https://www.britannica.com/place/Ranchi">Ranchi</a>.&nbsp; The industrial city of Ranchi is its capital and Dumka is sub capital while Jamshedpur is the largest and the biggest industrial city of the state.</p><p>&nbsp;</p><h4>Food&nbsp;</h4><p>Jharkhand is a state that people relate to mouth-watering and unique delicacies. Like all the other states Jharkhand has some local staples and a&nbsp;delicious treasure of traditional recipes. The cuisine of&nbsp;<a href="https://www.holidify.com/state/jharkhand/">Jharkhand</a>&nbsp;is not very different from its neighboring&nbsp;<a href="https://www.holidify.com/state/bihar/">Bihar</a>. It is truly exquisite and consists of a different cooking style, which makes it completely unique. Delicacies of Jharkhand use mustard oil as a medium for cooking, which gives it the characteristic aroma and pungency of flavors. Traditional staples of Jharkhand include litti chokha, pittha, handia and rugra. And for the sweet tooth they have malpua, thekua and tummy warming til barfi.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>Many tribes have inhabited this part of the country because of which the state has emerged as an important multi-ethnic state. The culture of the people depends on the community to which they belong, which influences there living style, rituals, dance, music, language, and literature. The communities of&nbsp;Jharkhand&nbsp;have a rich culture and tradition with several colorful festivals. Branches of scared trees are brought and ceremonially planted in the courtyards. The womenâ€™s clothing in&nbsp;Jharkhand&nbsp;is&nbsp;saree&nbsp;and&nbsp;blouse;&nbsp;one can find high-class&nbsp;Tussar silk&nbsp;sarees here. Whereas, Bhagwan&nbsp;is a single piece of cloth worn by men.&nbsp;</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Dassam falls</li><li>Betla National Park</li><li>Tagore hill</li><li>Dalma Wildlife Sanctuary</li><li>Hundru falls</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3742875.622349127!2d83.39158009667221!3d23.634727847792938!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x398b2386df480857%3A0x62c5b809eee29004!2sJharkhand!5e0!3m2!1sen!2sin!4v1587548038074!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 14:43:40', '2020-04-22 14:43:40'),
	(28, 'India', 'Lakshadweep', 'lakshadweep', '1587549398_5ea014d664be7.jpeg', NULL, '1587549398_5ea014d66695f.jpeg', NULL, '<h4>About</h4><p>Lakshadweep is a wonderful tropical archipelago of 36 atolls and coral reefs in the Laccadive Sea, off the coast of Kerala, India. Not all of the islands are inhabited, and only a few are open to visitors. Lakshadweep is also known as the â€œcoral islandsâ€ as they were formed from the corals. The islands are&nbsp;famous&nbsp;for their rich marine life due to the stable temperatures of the waters.&nbsp;Lakshadweep&nbsp;islands are a&nbsp;famous&nbsp;beach destination of India with crystal clear blue waters and coral reefs. The islands are also known for pearl fishing and are a major supplier of sea- food.</p><p>&nbsp;</p><p>&nbsp;</p><h4>Food</h4><p>The cuisine of Lakshadweep has a whole range of the freshest seafood mixed with a generous use of coconut. The food ranges from spicy non-veg to healthy veg and most often a certain authentic Kerala-element is obvious in the cuisine. Besides the vegetables and seafood, local people are also very fond of rice. Tuna fish being the most abundant, there are many varieties of dishes like grilled or baked tuna fish, rayereha (red tuna curry) and sannath (white coconut-based tuna). It is also known for the dishes like white coconut roti and Malabar parotta.&nbsp;</p><p>&nbsp;</p><h4>Culture</h4><p>Lakshadweep is culturally vibrant and diverse. The majority of population being Muslim, the culture here is heavily influenced by Islamic culture. Cultures of neighboring states like Kerala can also be seen here. Parichakali dance, kolkali dance and lava dance are the popular dance forms performed during weddings and festivals. Corals are an important part of the culture as well. Intricately designed ornaments and jewelry made out of shells and corals are a prominent part of the art and craft tradition.&nbsp;</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Agatti island</li><li>Bagaram atoll</li><li>Kadmat island</li><li>Kalpeni</li><li>Kilthan island</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4019476.361155808!2d70.54012096308199!3d10.320273093314078!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3b9fcd65cae4973d%3A0x17bd7416842ce9aa!2sLakshadweep!5e0!3m2!1sen!2sin!4v1587550597045!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 15:26:38', '2020-04-22 15:26:38'),
	(29, 'India', 'Arunachal Pradesh', 'arunachal-pradesh', '1587549703_5ea0160763c8a.jpeg', NULL, '1587549703_5ea0160765afc.jpeg', NULL, '<h2>About</h2><p>Arunachal Pradesh or the land of dawn lit mountains, as its name suggests, is a northeastern state, which shares its borders with Assam and Nagaland. The largest of the northeastern states, Arunachal Pradesh is reverently known as the â€˜Land of the Rising Sunâ€™. It is a destination, which offers numerous cathartic experiences. If one is looking for the perfect summer getaway in a place which is peaceful and assures bare minimum interaction, or if one simply wishes to indulge in some self-recreation, they can get out of their â€˜the perfect vacation does not exi-â€˜ phase and book a ticket to Arunachal Pradesh. We are sure your postcards or journal entry would end with â€˜and then there were no regretsâ€™.</p><h2>Food</h2><p>The standout point about the food of Arunachal Pradesh is the variety that it consists of. Numerous tribes have evolved over time in this place making it a diversity hub, which has resulted in the contrasting cuisine greatly. Overall, fried food is avoided by the natives and hence most of the dishes are either boiled or smoked. Food in eastern Arunachal Pradesh mostly comprises of bamboo and leafy vegetables. The places, which are closer to the border (Tibet), including Taiwan, have food items, which are rich in dairy products. The abundance of variety in the cuisine of this place assures that there is something for everyone here. The lack of fried food offers healthier yet scrumptious options for all the food lovers. Be it a vegetarian or a non-vegetarian, Arunachal delicacies are a delight for anyone who likes to experiment with their taste buds!&nbsp;</p><h2>Culture</h2><p>Being the hometown for 26 major tribes, Arunachal Pradesh is what one can literally term as the hub of diversity. The native languages of the people here are mostly derived from Tibeto-Burman language, which is further modified by over fifty dialects among various tribes. Assamese, Hindi and English are more prominently spoken besides the specific languages of the tribe due to the extended influence of Ahom dynasty. The culture and traditions, both religious and non-religious, are strongly influenced by nature in Arunachal Pradesh. From worshiping the sun and moon as deities to developing crafts and tools, which are prominently inclined towards nature, everything here depicts a deep-rooted sense of earthliness among the tribes. Hence for the people who appreciate down to earth traditions, which bring one closer to mother earth, Arunachal Pradesh is a â€˜must exploreâ€™ for them.&nbsp;</p><h4>Sightseeing</h4><ul><li>Tawang</li><li>Namdapha National Park</li><li>Upper Dibang Valley</li><li>Ziro Valley</li><li>Tezu</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7218461.860125015!2d89.98483169024078!3d27.943692433536764!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x374043466a1c7227%3A0x76b56e552f9a92f2!2sArunachal%20Pradesh!5e0!3m2!1sen!2sin!4v1587550883983!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-22 15:31:43', '2020-10-03 07:25:08'),
	(30, 'India', 'Manipur', 'manipur', '1587962027_5ea660ab5b723.jpeg', NULL, '1587962027_5ea660ab5f500.jpeg', NULL, '<h4>About</h4><p>Manipur is a place, which is greatly underrated, with a deep history, which largely remains unexplored by the majority of travelers. It resides between Nagaland, Mizoram and Assam, with Myanmar in the east. It has served as a connection between the Indian subcontinent and Central as well as Southeast Asia. Thus the culture in Manipur is greatly influenced by both. A trip to Manipur should be in the cards of every person who wishes to discover traditions and cultures, which remain obscure in mainland India. The best thing about this vacation destination is that it has to offer something for everyone. From a wildlife enthusiast to a historian, from a scenery lover to a culture explorer, Manipur has it all.</p><h4>&nbsp;</h4><h4>Food</h4><p>Manipuri cuisine is probably one the healthiest option when it comes to food choices in India. The dishes are usually very simple to prepare and have a unique savory flavor to them because of the different spices used. The ingredients used in authentic Manipur food, by the native households, are purely organic and hence the taste is usually hard to replicate elsewhere. Even though the food offers a fair variety, most of the dishes are fish based. So if you wish to experience this particularly spicy, less oily and organic cuisine, a trip to Manipur is a must!</p><h4>&nbsp;</h4><h4>Culture</h4><p>Manipur offers one of the most amazing experiences when it comes to art, craft and culture. Dating back to a pre Christian era, the history of the native people is vast and full of reformations. Although Manipur is known for its firm religious beliefs and superstitions, the stories and folklore depicting these are numerous. Other than religion, craft and history, Manipur also has several dance forms which have garnered praise over time. With its simplicity and uniqueness, Manipuri culture has subtly wormed its way into the hearts of many. For those who love to uncover historical facts and thoroughly explore their origins, Manipur is surely a gold mine.</p><h4>&nbsp;</h4><h4>Sightseeing</h4><ul><li>Leimaram Waterfalls</li><li>Chandel</li><li>Andro</li><li>Kakching</li><li>Dzukou Valley</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1854996.9268499466!2d92.73587851636863!3d24.75978771519805!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3749265bf16390db%3A0x8cc1691ae0a829af!2sManipur!5e0!3m2!1sen!2sin!4v1587963233868!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:03:47', '2020-04-27 10:03:47'),
	(31, 'India', 'Meghalaya', 'meghalaya', '1587962218_5ea6616aab332.jpeg', NULL, '1587962218_5ea6616aadf01.jpeg', NULL, '<h4>About</h4><p>The name of this state literally translates to â€˜the abode of cloudsâ€™, which is true to the notch. This hill area seldom flaunts a cloudless sky, and is a go-to destination for people looking for a pleasant weather get away. The climate is neither too warm in the summers nor too cold in the winters and hence Meghalaya is a prompt vacation spot all year round. The state shares its borders at the south and west with Bangladesh and at the north and east with Assam. Meghalaya also presents us with one of the most diverse flora and fauna in the country. So when one wishes for a recreational vacation, Meghalaya ticks all the boxes!</p><h4>Food</h4><p>Rice and curry dishes are predominant in the Meghalayan cuisine. Rice is used to prepare delicacies ranging from sweets to fried rice, and not only that, but it is also used to prepare Kyat, a fermented rice beer. The flavor of Meghalayan food is not just by the spices. The traditional day to day dishes are prepared with generous amount of time, thus providing the food with deeply cooked flavours of all the ingredients present. This not only enhances the flavor but also gives the dishes a uniqueness of their own which is hard to replicate with quickly cooked food. Pork is another prominent ingredient, which is also a staple diet for most of the natives and is creatively used in many of the food items, be it occasional or regular dishes. Meghalaya thus serves as a must for food lovers as well as those who wish to try out a new cuisine!</p><h4>Culture</h4><p>Meghalaya is rich with tradition and culture and most famous for its dance and music. Various tribes residing in Meghalaya have their own dance forms and folklores which hold great historical value because of their ancient origins. Each form is unique and exclusively depicts the culture of its tribe. The art and craft of Meghalaya is a flourished sector which flaunts not only historical and religious roots of the state but also the modern traditions. Bamboo weaving is a highly sought after craft skill which also serves as the livelihood for many. If one wishes to learn about the lifestyle of tribesmen as well as connect with nature at its truest form, Meghalaya wouldnâ€™t disappoint.</p><h4>Sightseeing</h4><ul><li>Nohkalikai Waterfalls</li><li>Double Decker Living Root Bridge</li><li>Umiam Lake</li><li>Elephant Falls</li><li>Dawki- Umngot River</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3685739.9741155915!2d89.0669595318715!3d25.559838740118472!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x37507e8f34bd207f%3A0xf5ef6117f496d6e!2sMeghalaya!5e0!3m2!1sen!2sin!4v1587963435120!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:06:58', '2020-04-27 10:06:58'),
	(32, 'India', 'Mizoram', 'mizoram', '1587962469_5ea662651ce5d.jpeg', NULL, '1587962469_5ea662651f848.jpeg', NULL, '<h4>About</h4><p>Mizoram, also known as the â€˜Land of Mizosâ€™, is the southernmost locked state out of the seven sisters and is surrounded by Assam, Tripura and Manipur. It also shares adjacent borders with Bangladesh and Myanmar. Like the other northeastern states, Mizoram too is abundantly inhabited by local tribal people. Since it has a lesser population, this state serves as an excellent getaway for those looking for a secluded vacation. The forested area also provides an intimacy with nature which is hard to get anywhere else. So if you wish to be surrounded by peace for a while, Mizoram is a definite go to destination.</p><h4>&nbsp;</h4><h4>Food</h4><p>The cuisine of Mizoram is partly unique and partly shared with the other northeastern states. Rice, combined with various kinds of meat, like chicken, pork, beef, and fish, serve as the staple diet of the native people. Most of the dishes that one would encounter in Mizoram are garnished with meat products, thus providing Mizo cuisine with a different twist of flavor. Mizoram also boasts one of the healthiest cuisines in the country, due to less oil and inclusion of various vegetables. Trying out the healthy yet lip smacking Mizoram food should be on every wandererâ€™s to-eat list!</p><h4>&nbsp;</h4><h4>Culture</h4><p>The mizo people are said to be highly sociable and down to earth tribesmen. Their culture and traditions represent the same qualities for over numerous generations. The tradition of Mizo people greatly revolves around Jhuman cultivation, which depicts the roots they share with nature and their connection with agricultural practices from ancient times. The festivals of Mizoram are more social gatherings than religious ones and people from different walks of life can take part and enjoy these unique get-togethers indulgently. Music is another art which the Mizo people are passionate about. Various folk songs and tale songs, dating back decades, are still sung and danced upon by the people of Mizoram.</p><h4>&nbsp;</h4><h4>Sightseeing</h4><ul><li>Aizawl</li><li>Vantawng Waterfalls</li><li>Dampa Tiger Reserve</li><li>Tamdil Lake</li><li>Phawngpui</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1877203.205481014!2d91.7267276126245!3d23.228071427632518!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x374d0bd19f3f36f7%3A0xb1f62692a3d5e474!2sMizoram!5e0!3m2!1sen!2sin!4v1587963660559!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:11:09', '2020-04-27 10:11:09'),
	(33, 'India', 'Tripura', 'tripura', '1587962647_5ea663177fffc.jpeg', NULL, '1587962647_5ea6631782ad5.jpeg', NULL, '<h4>About</h4><p>The tiniest baby of the northeastern states, Tripura is surrounded in the north, south and west by Bangladesh and in the east by Assam and Mizoram. Although poverty stricken and facing civic as well as political issues more often than not, Tripura boasts one of the highest literacy rate in India. Other than this, Tripura also has many (many and many) kinds of gardens. This state not only offers a picturesque site, but with its fusion of modern and traditional culture, it also has a peculiar attraction for those who seek the fusion of both the mainstream and the secluded. There is much to discover in this small yet intriguing state and each can find their own unique experience on a trip to Tripura.</p><h4>&nbsp;</h4><h4>Food</h4><p>Like in on other northeastern states, people in Tripura largely consume rice and varied kinds of meat. When it comes to Tripura, one cannot mention food without Mui Borok, the traditional dish of the state. Bangui rice, fish stews, food cooked in less oil with abundance of vegetables, Tripura cuisine really does scream â€˜comfort foodâ€™. Even though not majorly unique, the food of this state is everything you need after a dayâ€™s worth of good travel and exploring. Apart from the traditional dishes, Tripura cuisine is also influenced by its neighbor Bangladesh, Assam and the other northeastern states. Many prominent dishes or their modified versions can be found in this state.</p><h4>&nbsp;</h4><h4>Culture</h4><p>Due to the increasing population of migrants, the culture in Tripura is influenced both by the native people as well as Bengali culture. The languages spoken in the state and the diversity among the people are thus greatly rich and diverse, and yet complimentary. When it comes to craft, Tripura notably exceeds in bamboo and cane handicrafts. This not only depicts the creative streak of the native people but also helps in generating revenue. Songs and music are also deeply intricate parts of this wholesome culture. Be it a festival, a wedding or any other day, Tripurites will have a song for it all!</p><h4>&nbsp;</h4><h4>Sightseeing</h4><ul><li>Agartala</li><li>Dharamnagar</li><li>Unakoti- Timeless ruins</li><li>Sepahijala Wildlife Sanctuary</li><li>Ujjjayanta Palace</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d935010.6415472458!2d91.18237314199364!3d23.733635162157746!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3753b566f6c1a285%3A0x14dd7ae7453fff74!2sTripura!5e0!3m2!1sen!2sin!4v1587963876135!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:14:07', '2020-04-27 10:14:07'),
	(34, 'India', 'Punjab', 'punjab', '1587962975_5ea6645f47299.jpeg', NULL, '1587962975_5ea6645f48f96.jpeg', NULL, '<h4>About</h4><p>When it comes to tourism, Punjab tends to be quite an underrated choice. This gem of a state is famous for numerous purposes including the religious sentiments of many that this place connects with. But many of its picturesque as well as intriguing parts yet remain largely unexplored by the masses. Also referred to as â€˜the land of five riversâ€™ this state is surrounded by Jammu and Kashmir, Himachal Pradesh, Haryana and Rajasthan, hence it carries a mixture of fusion cultures along with its own unique historic traditions. This makes Punjab a perfect hub for those who are looking to indulge in a soul-searching yet fun vacation trip.</p><h4>&nbsp;</h4><h4>Food</h4><p>Punjabi cuisine is one of those rare cuisines that have made their way onto your table more often than not, many a times without you even realizing it. The food from Punjab has scattered all round the nation, fused with spices and recipes particular to a place making it a unique experience for each individual. Since Punjab is a state dominant in agriculture practice, the food largely consists of rice and numerous kinds of pulses along with high demands of meat and dairy products. The one thing, which is highly consistent in many dishes of Punjab, is the gravy and curry texture that is given to many of the items. This makes many different ingredients complement each other nicely, giving our taste buds a unique and flavorful experience. The spices are used extensively in this cuisine in order to counter the fried nature of most of the food items. If you wish to base your travel plans around heavenly food, Punjab is the perfect place to begin with!</p><h4>&nbsp;</h4><h4>Culture</h4><p>Punjab has a culture, which promotes romance and a love for life in all its art. Be it Bhangra, a dance form particularly attributed to this state which requires high levels of energy and agile movements, or be it poetry and folklore, of which there are countless based on any situation you can think of, everything exudes an affinity for love and life. When it comes to art and craft, one can easily observe the blast of color in every piece of handiwork. The culture and traditions of Punjab are as upbeat as the people here, and hence it is the perfect getaway if you need your spirits lifted.</p><h4>&nbsp;</h4><h4>Sightseeing</h4><ul><li>Amritsar</li><li>Chandigarh</li><li>Patiala</li><li>Pathankot</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3502061.890470402!2d73.15741805173222!3d30.998870326747056!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x391964aa569e7355%3A0x8fbd263103a38861!2sPunjab!5e0!3m2!1sen!2sin!4v1587964191412!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:19:35', '2020-04-27 10:19:35'),
	(36, 'India', 'Uttar pradesh', 'uttar-pradesh', '1587963242_5ea6656a153a3.jpeg', NULL, '1587963242_5ea6656a17d0d.jpeg', NULL, '<h4>About</h4><p>Uttar Pradesh is the most populous state in India, with over 200 million inhabitants and 75 districts. Due to its vastness geographically and connectivity with Rajasthan, Delhi, Haryana, Himachal Pradesh, Uttarakhand, Bihar, Madhya Pradesh, Jharkhand and Chattisgarh, the culture significantly varies throughout the state. It is difficult to label Uttar Pradesh thus, since it provides many contrasting yet complementary experiences to its tourists. UP is also the state, which receives the largest number of international and national tourists every year, making it a hotspot for tourist destination. This state is a dream-come-true for those who are explorers through and through. So if you are in a mood to discover something new, or just clear your mind and fill it with vibrancy, a trip to Uttar Pradesh will do you good.</p><h4>&nbsp;</h4><h4>Food</h4><p>The diverse inhabitants and their diverse history have a direct correlation with the diverse cuisines that this state has to offer. One cannot pin point a particular kind of taste to the cuisines of Uttar Pradesh. Ranging from sweet, to spicy, to subtle, this place has something to offer for every kind of craving. The dishes from Uttar Pradesh are almost equally inclined towards both vegetarian and non-vegetarian. And both are equally lip-smacking! Tunday kebab, Kulcha-NIhari, Tehri, Batti Chokha, Bedhai, Petha, Malpua, these dishes are literal comfort on a platter and these are just to name a few. Uttar Pradesh is equally mesmerizing as Punjab when it comes to food. To taste the authentic recipes of these dishes, and to experience a whole new world of culinary art, plan your next visit to this one of a kind place!</p><h4>&nbsp;</h4><h4>Culture</h4><p>Literature, cinema, dance, theatre, art, music, Uttar Pradesh is an abundance of culture and traditions followed since time immemorial which are constantly being refined and practiced throughout the region. Due to the influence of many different historical additions to this state, the traditions of this place are a beautiful amalgamation that gives Uttar Pradesh its unique identity which is truly unmatched. From religious destinations like Varanasi and Mathura, to historical towns like Sarnath and Khushinagar, this state has hidden gems for everone! The architecture of this state differs greatly from region to region and boasts a refined art that has existed since centuries back. Various languages also have a deep-rooted history here, such as Urdu, Braj, Awadhi, Hindi and literature and art related to the development of these languages can be found in this state.&nbsp;</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Agra</li><li>Varanasi</li><li>Vrindavan</li><li>Lucknow</li><li>Allahabad</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7276029.722307557!2d76.38912593265447!3d27.069673220557824!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39994e9f7b4a09d3%3A0xf6a5476d3617249d!2sUttar%20Pradesh!5e0!3m2!1sen!2sin!4v1587964415944!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:24:02', '2020-04-27 10:24:02'),
	(37, 'India', 'Bihar', 'bihar', '1587963451_5ea6663b67eef.jpeg', NULL, '1587963451_5ea6663b6a802.jpeg', NULL, '<h2>About</h2><p>Bihar is a state, which is deeply rooted in tradition and culture. Home to the Ganges, Bihar is not only scenic but also has a serene atmosphere and a very down-to-earth environment. In ancient India, this state also boasted the title of the center of power and learning. The birthplace of Maurya dynasty as well as Buddhism, Bihar has a vast historical importance not only in India but globally as well. Although not highly developed in terms of infrastructure and economy, this state still has so much to offer when it comes to knowledge and spirituality. Not only this, but Bihar also has an amalgamation of many different cultural backgrounds which makes it a rich hub of diversity and contrasting traditions. If you wish to have a raw and intellectually fulfilling backpacking trip, Bihar is one place that you should rediscover.&nbsp;</p><h4>&nbsp;</h4><h2>Food</h2><p>Bihari cuisine is especially unique and one of a kind. From fried to baked, from sweet to sour, this cuisine has extreme variations to please everyone. The food is not only scrumptious, but it is also notable because of its comparative healthy nature even though it tastes sinfully delicious. Although heavy in carbs, the food in this state is generally prepared using substitute ingredients, which are richer in proteins and fibres. From Balushahi and Pantua to mutton kebabs and litti chokha, you cannot limit the variety of this cuisine into a particular category. Many dishes of Uttar Pradesh are famous all over India, but many are still limitedly discovered. To take oneâ€™s taste buds for a ride, a trip to Bihar is an absolute necessity.</p><h4>&nbsp;</h4><h2>Culture</h2><p>When one talks of Bihar and the culture it displays, the mention of Mithila painting style is never far behind. Although Bihar boasts numerous styles of painting, Mithila style, also known as Madhubani art, is the most famous type of painting style of this state. It was traditionally a painting done during occasions on the walls of huts and households, but later on the art began to appear on fabrics, handmade papers and then canvas as well. Apart from this, Bihar is also a treasure chest of world class music, poetry, and prose. Due to the diverse languages present in this state, literature and music originated from here have gathered a vast audience throughout the country. The multilingual aspect, the bulk of history connected with it, as well as the spiritual and religious getaways this state has to offer are reason enough to divulge in a trip to Bihar at least once!</p><h2>&nbsp;</h2><h2>Sightseeing</h2><ul><li>Bodh Gaya</li><li>Nalanda</li><li>Sitamarhi</li><li>Valmiki National Park</li><li>Navlakha Palace</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3675629.277047704!2d83.55830839228621!3d25.886530237465575!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39ed5844f0bb6903%3A0x57ad3fed1bbae325!2sBihar!5e0!3m2!1sen!2sin!4v1587964655844!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:27:31', '2020-10-03 07:27:03'),
	(38, 'India', 'Ladakh', 'ladakh', '1587963788_5ea6678c214ae.jpeg', NULL, '1587963788_5ea6678c2322d.jpeg', NULL, '<h4>About</h4><p>Ladakh is a Union Territory in northern India, and was previously a region of Jammu and Kashmir. The â€˜land of high passesâ€™, as it is sometimes referred to as, has garnered significant attention due to its remote mountainous range, which provides a scenic beauty that is unrivaled. This region is influenced greatly by Tibetan culture and is thus endearingly labeled as â€˜Little Tibetâ€™. Ladakh is one of the least populated regions in the northern area, so it not only serves as an excellent tourist attraction due to its aesthetics, but also as the perfect place to take a retreat. Be it a spiritual getaway or just a withdrawal from oneâ€™s day to day life, Ladakh is the go-to place when it comes to a little soul searching.</p><h4>&nbsp;</h4><h4>Food</h4><p>Ladakh food is greatly derived from Tibetan cuisine since the predominant culture of the area is the same. The cuisine of Ladakh is also much influenced by the extremely cold weather that it experiences throughout the year. The level of spices used in the dishes is higher in order to tackle the cold. Meat and beef are prominent ingredients in many dishes, making Ladakhâ€™s cuisine rich in nutritional value. The cuisine also boasts recipes which are mostly broth based. Various kinds of soups and stews are sometimes prepared with flour dumplings and at other times with mutton or beef. All the recipes are seasoned graciously with numerous vegetables thus giving the dishes a unique texture and flavor. Dairy products are also used significantly to prepare side dishes that complement the food in Ladakh. These preparations, like gur gur cha, provide high energy and warmth. Ladakh cuisine is what one can imagine as comfort food through and through!</p><h4>&nbsp;</h4><h4>Culture</h4><p>The culture of Tibet is more inclined towards that of Tibet and Central Asia than towards India. The whole population of the land is either Buddhist or Muslim, although a very small ratio of Hindus also reside the area. Agricultural and pastoral lifestyle is the mainstream source of earning, but the trade is remote and is majorly confined to nearby areas only. Apart from cultivating wheat, barley, etc, the inhibitants of Ladakh also grow apples and apricots on the lower altitudes. Sheep rearing is one of the mainstream occupations and provides the renowned pashmina wool. Ladakh is also famous for its unique fauna, which comprises of red bear, ibex, snow leopard, antelope, gazelle, wild sheep etc. It is also rich in numerous semi-precious stones as well as copper and gold. If you wish to discover a tradition, which differs greatly from that of the rest of India, Ladakh is the best-secluded reprise for you!</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Kargil</li><li>Zanskar Valley</li><li>Khardung-la Pass</li><li>Magnetic Hill</li><li>Shanti Stupa</li></ul>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3301.3209738813957!2d77.57957231470246!3d34.16371041929625!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38fdeb3f7909dfb5%3A0x88202f821461c0e6!2sLadakh!5e0!3m2!1sen!2sin!4v1587965010746!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:33:08', '2020-04-27 10:33:08'),
	(39, 'India', 'Chhattisgarh', 'chhattisgarh', '1587964036_5ea66884ac12e.jpeg', NULL, '1587964036_5ea66884ade16.jpeg', NULL, '<h4>About</h4><p>One of the fastest developing states in India as well as the source of the countryâ€™s major portion of electricity, steel and coal, Chhattisgarh is not only a powerhouse but also a hidden gem of culture and potential. Situated at the heart of India, this state holds rare wildlife and natural diversity that attract numerous tourists annually. Apart from a rich geography, Chhattisgarh also boasts a rich historical background. Carved temples, monasteries, palaces, caves, rock paintings, waterfalls, hot springs, the list goes on and on if we talk about the treasures that this state holds. Wildlife sanctuaries and national parks are also abundant in Chhattisgarh. In fact, Raipur, a district of this state, is the home to the first man-made jungle safari. This state is a mix pot for diverse interests and definitely needs to be on your travel list!</p><h4>&nbsp;</h4><h4>Food</h4><p>Agriculture is also a major sector in Chhattisgarh and hence the inclusion of various cereals in its cuisine is a given. Rice, Bajra and Jawar based dishes are prominent in the state, although one can easily find many dishes which have been inspired by their neighboring states thus providing the cuisine of Chhattisgarh with a fresh variety. The food in this state leans pretty heavily towards fried. All the major dishes are either fried or prepared using high amounts of oil and ghee, although the use of ingredients like â€˜besanâ€™ instead of â€˜maidaâ€™ results in balancing out the high fats level. The main courses are usually accompanied by numerous side dishes, including dessert. The amount of spices is also generous in most of the food items. If you are a foodie through and through, then Chhattisgarh is the ultimate destination for you to discover a brand new cuisine.</p><h4>&nbsp;</h4><h4>Culture</h4><p>Chhattisgarh, just like many other states of India, is a mixture of people hailing from many different regions, and thus belonging to different religions. Being almost at the center, it serves as a prime location for the diverse cultures to coexist. Literature and theatre are very much celebrated in this state. Being historically of importance, Chhattisgarh had started documenting the development of its culture through these mediums from a long time ago. When it comes to art and craft, Kosa silk and lost wax art are two things for which this state is known. Chhattisgarh also boasts a wide variety of dance styles each of which has evolved from a different tradition or culture of the state. Discovering all the aspects and the mingling of the various religious sects and their cultures that are present in the state should be an exciting recreational activity if you are a curiosity buff.</p><p>&nbsp;</p><h4>Sightseeing</h4><ul><li>Barnawapara Wildlife Sanctuary</li><li>Shri Rajiv Lochan Mandir</li><li>Chitrakot Waterfalls</li><li>Mahakoshal Art Gallery</li></ul>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3815846.384741192!2d80.07574290474389!3d20.935944041016107!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3a261f16c67a8bad%3A0x5c23f412fb179d95!2sChhattisgarh!5e0!3m2!1sen!2sin!4v1587965257787!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-04-27 10:37:16', '2020-04-27 10:37:16'),
	(40, 'India', 'Himachal Pradesh', 'himachal-pradesh', '1588328076_5eabf68cc255c.jpeg', NULL, '1588328076_5eabf68cc4efa.jpeg', NULL, '<h4>About</h4><p>Himachal Pradesh is a scenic state located alongside the Great Himalayas.&nbsp;&nbsp;It\'s home to breath-taking mountain towns and resorts such as Dalhousie. The state has a strong Tibetan presence. It can be witnessed through the Buddhist temples and monasteries, as well as its vibrant Tibetan New Year celebrations. Home of Dalai Lama, Himachal Pradesh is the land of brewing rich culture and enchanting natural beauty. The region is also well known for its adventurous angle, offering activities like trekking, climbing and skiing areas.</p><p>&nbsp;</p><h4>Food</h4><p>Himachal Pradesh is known for its scrumptious cuisine.&nbsp;From the road vendors to the authentic cafes and restaurant, the Himachali people will pour their heart out in their dishes.&nbsp;The surrounding states of&nbsp;<a href="https://food.ndtv.com/food-drinks/5-best-lassi-recipes-the-creamy-summer-cooler-from-punjab-1402630">Punjab</a>&nbsp;and&nbsp;<a href="https://food.ndtv.com/opinions/the-tale-of-thukpa-what-lends-flavour-to-this-comforting-noodle-soup-1277458">Tibet&nbsp;</a>have a deep influence. Most of their dishes are slow-cooked imparting a unique flavour and aroma and a lot of their preparations are also fermented. The cuisine is predominantly homely yet rich and intense. Some Himachali wonders are madra, tudkiya bhath, and chaha gosht. And to enjoy the snowy hill views better, have babroo and mittha for dessert.</p><p>&nbsp;</p><h4>Culture</h4><p>Himachal Pradesh&nbsp;is a multi religious, multicultural as well as a multilingual state like other Indian states. The official language of this state is&nbsp;Pahari&nbsp;and&nbsp;Hindi.&nbsp;Apart from all festivals celebrated in India there are some unique festivals of Himachal Pradesh.&nbsp;Some of these fairs and festivals in the upper regions are the Kullu Dussehra, Shivratri Fair&nbsp;(Mandi),&nbsp;Shoolini Mela&nbsp;(Solan) and&nbsp;Minjar Fair&nbsp;(Chamba).&nbsp;Music and dance beautifully reflect the culture and the tradition of Himachal Pradesh. Some of them are are Losar and Shona, Chuksa. The people of Himachal Pradesh mostly wear woolens, as itâ€™s best suited to the climate.&nbsp;Scarves and shawls are ubiquitous with the women while the men can be found in various types of Kurtas and the typical Himachal cap.</p><p>&nbsp;</p><h4><strong>Sightseeing</strong></h4><ul><li>Rohtang La</li><li>Solang Nala</li><li>Hidimba Devi temple</li><li>Spiti Valley</li><li>The Great Himalayan National Park</li><li>Chandra Taal</li></ul><p>&nbsp;</p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3472279.549286716!2d75.05168106520073!3d31.800529756338427!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x390453c367f901f7%3A0x7cfe04c5564b7725!2sHimachal%20Pradesh!5e0!3m2!1sen!2sin!4v1588329142330!5m2!1sen!2sin" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>', '2020-05-01 15:44:36', '2020-05-01 15:44:36'),
