	(34, 'New Delhi', 'Ahmedabad', 'Ahmedabad-Vadodara-Statue Of Unity-Modhera', '1584767408.jpeg', NULL, 'bn1584767408.jpeg', NULL, 5, '<p><i><strong>Explore the westernmost state of India and all its glory in vibrant cities, historic monuments and patriotic symbols.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-21 10:40:08', '2020-03-21 10:40:08'),
	(35, 'New Delhi', 'Singapore', 'Singapore-Kuala Lumpur', '1584768369.jpeg', NULL, 'bn1584768369.jpeg', NULL, 7, '<p><i><strong>Experience the wonders of the Lion City and live the blend of cultural richness and magnificent infrastructure.</strong></i></p>', 'International', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-21 10:56:09', '2020-03-21 10:56:09'),
	(36, 'New Delhi', 'Toronto', 'Toronto- Ottawa', '1584769875.jpeg', NULL, 'bn1584769875.jpeg', NULL, 10, '<p><i><strong>Be in Canada and explore the stunning blend of nature, art and technology.</strong></i></p>', 'International', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-21 11:21:15', '2020-04-05 15:36:22'),
	(37, 'Hyderabad', 'Udaipur', 'GUJARAT AHMEDABAD-MODHERA-MT.ABU-UDAIPUR', '1584961457.jpeg', NULL, 'bn1584961458.jpeg', NULL, 4, '<p><i><strong>Gujarat, India\'s westernmost state, has varied terrain and numerous sacred sites. In its urban center of Ahmedabad is the Calico Museum of Textiles, displaying antique and modern Indian fabrics. Spiritual leader Mahatma Gandhi\'s base from 1917â€“1930 was Sabarmati Ashram.</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-23 16:34:18', '2020-04-06 11:11:20'),
	(40, 'Hyderabad', 'Kochi', 'MADURAI-KODAIKANAL- MUNNAR- KOCHI', '1584965371.jpeg', NULL, 'bn1584965371.jpeg', NULL, 6, '<p><i><strong>Madurai is an energetic, ancient city on the Vaigai River in the South Indian state of Tamil Nadu. Its skyline is dominated by the 14 colorful gopurams (gateway towers) of Meenakshi Amman Temple.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-23 17:39:31', '2020-04-06 11:13:35'),
	(42, 'Hyderabad', 'Delhi', 'JAIPUR -JODHPUR-JAISALMER-DELHI', '1585024564.jpeg', NULL, '1585024564.jpeg', NULL, 7, '<p><i><strong>Rajasthan is a state in northern India. The state covers an area of 342,239 square kilometres or 10.4 percent of the total geographical area of India. It is the largest Indian state by area and the seventh largest by population.</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-24 10:04:24', '2020-03-24 10:06:04'),
	(44, 'Ludhiana', 'Ahmedabad', 'LUDHIANA-AHMEDABAD-VADODARA-STATUE OF UNITY-MODHERA', '1585027015.jpeg', NULL, 'bn1585027015.jpeg', NULL, 7, '<p><i><strong>Gujarat, India\'s westernmost state, has varied terrain and numerous sacred sites. In its urban center of Ahmedabad is the Calico Museum of Textiles, displaying antique and modern Indian fabrics. Spiritual leader Mahatma Gandhi\'s base from 1917â€“1930 was Sabarmati Ashram.</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-24 10:46:55', '2020-04-06 14:47:33'),
	(47, 'New Delhi', 'Chittorgarh', 'DELHI-UDAIPUR-CHITTORGARH', '1585030219.jpeg', NULL, 'bn1585030219.jpeg', NULL, 4, '<p><i><strong>Udaipur, formerly the capital of the Mewar Kingdom, is a city in the western Indian state of Rajasthan. Founded by Maharana Udai Singh II in 1559, itâ€™s set around a series of artificial lakes and is known for its lavish royal residences.&nbsp;</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-24 11:40:19', '2020-04-06 14:56:07'),
	(48, 'Hyderabad', 'Bangalore', 'BANGALORE-MYSORE-COORG', '1585031777.jpeg', NULL, 'bn1585031777.jpeg', NULL, 5, '<p><i><strong>Bengaluru (also called Bangalore) is the capital of India\'s southern Karnataka state. The center of India\'s high-tech industry, the city is also known for its parks and nightlife. By Cubbon Park, Vidhana Soudha is a Neo-Dravidian legislative building.</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-24 12:06:17', '2020-03-24 12:06:17'),
	(49, 'Hyderabad', 'Bagdogra', 'GLIMPSE OF BHUTAN PARO-THIMPHU', '1585043303.jpeg', NULL, 'bn1585043303.jpeg', NULL, 6, '<p><i><strong>Bhutan, a Buddhist kingdom on the Himalayasâ€™ eastern edge, is known for its monasteries, fortresses (or dzongs) and dramatic landscapes that range from subtropical plains to steep mountains and valleys. In the High Himalayas, peaks such as 7,326m Jomolhari are popular trekking destinations.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-24 15:18:23', '2020-04-06 11:18:06'),
	(50, 'New Delhi', 'Paris', 'EUROPE-ROME-AUSTRIA-SWITZERLAND-PARIS', '1585046242.jpeg', NULL, 'bn1585046242.jpeg', NULL, 9, '<p><i><strong>Paris, France\'s capital, is a major European city and a global center for art, fashion, gastronomy and culture. Its 19th-century cityscape is crisscrossed by wide boulevards and the River Seine. Beyond such landmarks as the Eiffel Tower and the 12th-century, Gothic Notre-Dame cathedral, the city is known for its cafe culture and designer boutiques along the Rue du Faubourg Saint-HonorÃ©.</strong></i></p>', 'International', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-24 16:07:22', '2020-03-24 16:07:22'),
	(51, 'Ludhiana', 'Paris', 'EUROPE-ROME-AUSTRIA-SWITZERLAND-PARIS', '1585046256.jpeg', NULL, 'bn1585046256.jpeg', NULL, 10, '<p><i><strong>Paris, France\'s capital, is a major European city and a global center for art, fashion, gastronomy and culture. Its 19th-century cityscape is crisscrossed by wide boulevards and the River Seine.The city is known for its cafe culture and designer boutiques along the Rue du Faubourg Saint-Honore.</strong></i></p>', 'International', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-24 16:07:36', '2020-04-05 17:38:55'),
	(52, 'Delhi', 'Dubai', 'DUBAI-ABU DHABI', '1585052418.jpeg', NULL, 'bn1585052418.jpeg', NULL, 6, '<p><i><strong>Dubai is a city and emirate in the United Arab Emirates known for luxury shopping, ultramodern architecture and a lively nightlife scene. Burj Khalifa, an 830m-tall tower, dominates the skyscraper-filled skyline. At its foot lies Dubai Fountain, with jets and lights choreographed to music.</strong></i></p>', 'International', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-24 17:50:18', '2020-03-24 17:50:18'),
	(57, 'Delhi', 'Delhi', 'DAY RETURN TOUR TO NEEMRANA FORT PALACE', '1585112597.png', NULL, 'bn1585112597.png', NULL, 1, '<p><i><strong>NEEMRANA FORT PALACE: Situated on Delhi-Jaipur Highway, Neemrana Fort-Palace is a 15th-century heritage hotel, and is among the most popular resorts near Delhi for weekend. It is the site of a 16th-century hill-fort occupied by Chauhans till 1947. The erstwhile ruling family is considered to be of the direct lineage of Prithviraj Chauhan.</strong></i></p>', 'National', '0', '1', NULL, NULL, '1', NULL, '1', '2020-03-25 10:33:17', '2021-03-23 09:36:38'),
	(58, 'Delhi', 'Jaipur', 'Jaipur-City Palace', '1585114539.png', NULL, 'bn1585114539.png', NULL, 2, '<p><i><strong>Jaipur is the capital of Indiaâ€™s Rajasthan state. It evokes the royal family that once ruled the region and that, in 1727, founded what is now called the Old City, or â€œPink Cityâ€ for its trademark building color.</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-25 11:05:39', '2021-03-23 09:36:38'),
