	(61, 'Delhi', 'Haridwar', 'Haridwal-Lansdowne', '1585120907.png', NULL, 'bn1585120907.png', NULL, 2, '<p><i><strong>Lansdowne is a hill station in the north Indian state of Uttarakhand. It was founded as a military garrison under the British Raj, and the Garhwali Museum traces the history of the Garhwal Rifles regiment, which still trains in the town.&nbsp;</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-25 12:51:47', '2021-03-23 09:36:38'),
	(62, 'Delhi', 'Hyderabad', 'HYDERABAD-RAMOJI FILM CITY', '1585121736.png', NULL, 'bn1585121736.png', NULL, 3, '<p><i><strong>The Ramoji Film City in </strong></i><a href="https://en.wikipedia.org/wiki/India"><i><strong>India</strong></i></a><i><strong> is located in </strong></i><a href="https://en.wikipedia.org/wiki/Hyderabad,_India"><i><strong>Hyderabad</strong></i></a><i><strong>. Spread over 1666 acres, it is the largest integrated film city in the world and as such has been certified by the </strong></i><a href="https://en.wikipedia.org/wiki/Guinness_World_Records"><i><strong>Guinness World Records</strong></i></a><i><strong> as the largest studio complex in the world. It was built by Telugu film producer Ramoji Rao in 1996.</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-25 13:05:36', '2021-03-23 09:36:38'),
	(63, 'Hyderabad', 'Jaipur', 'HYDERABAD-JAIPUR â€“ RANTHAMBORE NATIONAL PARK', '1585130362.jpeg', NULL, 'bn1585130362.jpeg', NULL, 4, '<p><i><strong>Ranthambhore National Park or Ranthambhore is a </strong></i><a href="https://en.wikipedia.org/wiki/National_park"><i><strong>national park</strong></i></a><i><strong> in </strong></i><a href="https://en.wikipedia.org/wiki/Northern_India"><i><strong>northern</strong></i></a><i><strong> </strong></i><a href="https://en.wikipedia.org/wiki/India"><i><strong>India</strong></i></a><i><strong>, initially covering 282&nbsp;kmÂ² at the time it was formed. Ranthambhore was established as the Sawai Madhopur Game Sanctuary in 1955 by the </strong></i><a href="https://en.wikipedia.org/wiki/Government_of_India"><i><strong>Government of India</strong></i></a><i><strong>.</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-25 15:29:22', '2021-03-23 09:36:38'),
