	(80, 'Delhi', 'Bangalore', 'DELHI-BANGALORE-MYSORE-COORG-WONDER-LA', '1585222214.jpeg', NULL, 'bn1585222214.jpeg', NULL, 4, '<p><i><strong>Bengaluru (also called Bangalore) is the capital of India\'s southern Karnataka state. The center of India\'s high-tech industry, the city is also known for its parks and nightlife. By Cubbon Park, Vidhana Soudha is a Neo-Dravidian legislative building.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-26 17:00:14', '2021-03-23 09:36:38'),
	(81, 'Delhi', 'Jodhpur', 'DELHI -JODHPUR-UDAIPUR-DELHI', '1585223360.jpeg', NULL, 'bn1585223360.jpeg', NULL, 5, '<p><i><strong>Rajasthan is the Glorious and Royal state of India and located on northwestern side of India. It is land of Kings and Queens. Rajasthan is very rich in its culture and tradition which grab the attention of tourists. The Blue city of Rajasthan or Jodhpur is the capital of MARWAR Kingdom.</strong></i></p>', 'National', '3', '1', '1', '0', '1', NULL, '1', '2020-03-26 17:19:21', '2021-03-23 09:36:38'),
