	(89, 'Hyderabad', 'Ranikhet', 'HYDERABAD-UTTARAKHAND  RANIKHET-NAINTIAL', '1585293212.png', NULL, 'bn1585293212.png', NULL, 4, '<p><i><strong>Ranikhet - Meadows of the Queen: literally meaning - Queens Land, is an all season tourist-spot for the admirers of the natural beauty. Ranikhet is a place that reflects the best of the great Himalayas. The charming and majestic views of the pine trees, lush green forests.</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-27 12:43:33', '2021-03-23 09:36:38'),
	(90, 'Hyderabad', 'Gwalior', 'HYDERABAD-GWALIOR-JHANSI-ORCHHA', '1585300805.png', NULL, 'bn1585300805.png', NULL, 5, '<p><i><strong>Gwalior is a city in the central Indian state of Madhya Pradesh. It\'s known for its palaces and temples, including the Sas Bahu Ka Mandir intricately carved Hindu temple.&nbsp;</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-27 14:50:06', '2021-03-23 09:36:38'),
	(91, 'Hyderabad', 'Dhanaulti', 'HYDERABAD-AGRA-DHANAULTI-MUSSOORI-DEHRADUN', '1585302100.png', NULL, 'bn1585302100.png', NULL, 6, '<p><i><strong>Uttarakhand, a state in northern India crossed by the Himalayas, is known for its Hindu pilgrimage sites. Rishikesh, a major centre for yoga study, was made famous by the Beatlesâ€™ 1968 visit. The city hosts the evening Ganga Aarti, a spiritual gathering on the sacred Ganges River.&nbsp;</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-27 15:11:40', '2021-03-23 09:36:38'),
	(92, 'Hyderabad', 'Mumbai', 'HYDERABAD-MAHABALESHWAR- LONAVALA-MUMBAI', '1585303986.jpeg', NULL, 'bn1585303986.jpeg', NULL, 5, '<p><i><strong>Mumbai (formerly called Bombay) is a densely populated city on Indiaâ€™s west coast. A financial center, it\'s India\'s largest city. On the Mumbai Harbour waterfront stands the iconic Gateway of India stone arch, built by the British Raj in 1924.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-27 15:43:06', '2021-03-23 09:36:38'),
	(93, 'Ludhiana', 'Jaipur', 'LUDHIANA-JAIPUR', '1585310490.png', NULL, 'bn1585310490.png', NULL, 4, '<p><i><strong>Jaipur is the capital of Indiaâ€™s Rajasthan state. It evokes the royal family that once ruled the region and that, in 1727, Jaipur is now called the Old City, or â€œPink Cityâ€ for its trademark building color.&nbsp;</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-27 17:31:30', '2021-03-23 09:36:38'),
	(94, 'Ludhiana', 'Hyderabad', 'LUDHIANA-HYDERABAD-RAMOJI FILM CITY', '1585311609.png', NULL, 'bn1585311609.png', NULL, 5, '<p><i><strong>Hyderabad is the capital of southern India\'s Telangana state. A major center for the technology industry, it\'s home to many upscale restaurants and shops. Its historic sites include Golconda Fort, a former diamond-trading center that was once the Qutb Shahi dynastic capital.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-27 17:50:09', '2021-03-23 09:36:38'),
	(95, 'Hyderabad', 'Amritsar', 'HYDERABAD-DELHI-AGRA-AMRITSAR', '1585374645.png', NULL, 'bn1585374645.png', NULL, 5, '<p><i><strong>Agra is a city on the banks of the Yamuna river in the Indian state of Uttar Pradesh. It is 206 kilometres south of the national capital New Delhi. Agra is the fourth-most populous city in Uttar Pradesh and 24th in India.</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-28 11:20:45', '2021-03-23 09:36:38'),
	(96, 'Hyderabad', 'Nainital', 'HYDERABAD-DELHI-CORBETT-NAINITAL', '1585375563.png', NULL, 'bn1585375563.png', NULL, 5, '<p><i><strong>Jim Corbett National Park is a forested wildlife sanctuary in northern Indiaâ€™s Uttarakhand State. Rich in flora and fauna, itâ€™s known for its Bengal tigers. Animals, including tigers, leopards and wild elephants, roam the Dhikala zone.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-28 11:36:03', '2021-03-23 09:36:38'),
	(97, 'Ahmedabad', 'Vadodara', 'AHMEDABAD-VADODARA-AMUL ANAND-STATUE OF UNITY', '1585376229.jpeg', NULL, 'bn1585376229.jpeg', NULL, 2, '<p><i><strong>Vadodara is a large city in the Indian state of Gujarat. It is the administrative headquarters of Vadodara District and is located on the banks of the Vishwamitri river, 141 kilometres from the state capital Gandhinagar.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, NULL, '1', NULL, '1', '2020-03-28 11:47:09', '2021-03-23 09:36:38'),
	(98, 'Ahmedabad', 'Udaipur', 'AHMEDABAD-MTABU-UDAIPUR', '1585377015.png', NULL, 'bn1585377015.jpeg', NULL, 4, '<p><strong><em>Udaipur, formerly the capital of the Mewar Kingdom, is a city in the western Indian state of Rajasthan. Founded by Maharana Udai Singh II in 1559, itâ€™s set around a series of artificial lakes and is known for its lavish royal residences. Mt Abu a famous hill station in the region of Rajasthan.</em></strong>&nbsp;</p>', 'National', '3', '1', NULL, NULL, '1', NULL, '1', '2020-03-28 12:00:15', '2021-03-23 09:36:38'),
	(99, 'Ahmedabad', 'Bangalore', 'AHMEDABAD-BANGALORE-MYSORE-WONDERLA', '1585378038.jpeg', NULL, 'bn1585378038.jpeg', NULL, 4, '<p><i><strong>Bangalore and Mysore is the major Tourist destination in Karnataka. Bangalore where you can know about different IT sector, in other hand Mysore can give you the experience of Royalness.</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-28 12:17:18', '2021-03-23 09:36:38'),
	(100, 'Ahmedabad', 'Ahmedabad', 'DAY RETURN TOUR TO AHMEDABAD', '1585378344.jpeg', NULL, 'bn1585378344.jpeg', NULL, 1, '<p><i><strong>Ahmedabad, in western India, is the largest city in the state of Gujarat. The Sabarmati River runs through its center. On the western bank is the Gandhi Ashram at Sabarmati, which displays the spiritual leaderâ€™s living quarters and artifacts. Across the river, the Calico Museum of Textiles, once a cloth merchant\'s mansion, has a significant collection of antique and modern fabrics.</strong></i></p>', 'National', '0', '1', NULL, NULL, '1', NULL, '1', '2020-03-28 12:22:24', '2021-03-23 09:36:38'),
	(101, 'Ahmedabad', 'Ahmedabad', 'DAY RETURN TOUR TO MODHERA', '1585378862.jpeg', NULL, 'bn1585378862.jpeg', NULL, 1, '<p><i><strong>Modhera is a town in Mehsana district of Gujarat, India. The town is well known for the Sun Temple of Chaulukya era. The town is located on the bank of river Pushpavati.</strong></i></p>', 'National', '0', '1', NULL, NULL, '1', NULL, '1', '2020-03-28 12:31:02', '2021-03-23 09:36:38'),
	(102, 'Surat', 'Jaipur', 'SURAT-JAIPUR â€“ RANTHAMBHORE', '1585379655.jpeg', NULL, 'bn1585379655.jpeg', NULL, 5, '<p><i><strong>Jaipur is the capital of Indiaâ€™s Rajasthan state. It evokes the royal family that once ruled the region and that, in 1727, founded what is now called the Old City, or â€œPink Cityâ€ for its trademark building color.Ranthambhore is a </strong></i><a href="https://en.wikipedia.org/wiki/National_park"><i><strong>national park</strong></i></a><i><strong> in </strong></i><a href="https://en.wikipedia.org/wiki/Northern_India"><i><strong>northern</strong></i></a><i><strong> </strong></i><a href="https://en.wikipedia.org/wiki/India"><i><strong>India</strong></i></a><i><strong>.&nbsp;</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-28 12:44:15', '2021-03-23 09:36:38'),
	(103, 'Surat', 'Bangalore', 'SURAT-BANGALORE-MYSORE-OOTY', '1585380538.jpeg', NULL, 'bn1585380539.jpeg', NULL, 5, '<p><strong>Bengaluru (also called Bangalore) is the capital of India\'s southern Karnataka state. The center of India\'s high-tech industry.It hold the &nbsp;former royal residences &nbsp;which includes 19th-century Bangalore Palace, modeled after Englandâ€™s Windsor Castle, and Tipu Sultanâ€™s Summer Palace, an 18th-century teak structure.</strong></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-28 12:58:59', '2021-03-23 09:36:38'),
	(104, 'Ambala', 'Jaipur', 'AMBALA-JAIPUR-JODHPUR- JAISALMER-JAIPUR', '1585390528.jpeg', NULL, 'bn1585390528.jpeg', NULL, 7, '<p><i><strong>Jaisalmer is a former medieval trading center and a princely state in the western Indian state of Rajasthan, in the heart of the Thar Desert. Known as the "Golden City," it\'s distinguished by its yellow sandstone architecture. Dominating the skyline is Jaisalmer Fort, a sprawling hilltop citadel buttressed by 99 bastions. Behind its massive walls stand the ornate Maharaja\'s Palace and intricately carved Jain temples.</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-28 15:45:28', '2021-03-23 09:36:39'),
	(105, 'Ambala', 'Delhi', 'AMBALA-JAIPUR-UDAIPUR-MT. ABU- DELHI', '1585392753.jpeg', NULL, 'bn1585392753.jpeg', NULL, 8, '<p><i><strong>Udaipur, formerly the capital of the Mewar Kingdom, is a city in the western Indian state of Rajasthan. Founded by Maharana Udai Singh II in 1559, itâ€™s set around a series of artificial lakes and is known for its lavish royal residences. Mount Abu is a hill station in western Indiaâ€™s Rajasthan state.Jaipur is the capital of Indiaâ€™s Rajasthan state. It evokes the royal family that once ruled the region.Jaipur is also known as the pink city.</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-28 16:22:33', '2021-03-23 09:36:39'),
	(106, 'Chandigarh', 'Hyderabad', 'CHANDIGARH-HYDERABAD-RAMOJI FILM CITY', '1585393658.png', NULL, 'bn1585393658.png', NULL, 4, '<p><strong><em>Hyderabad is the capital of southern India\'s Telangana state. A major center for the technology industry, it\'s home to many upscale restaurants and shops. Its historic sites include Golconda Fort, a former diamond-trading center that was once the Qutb Shahi dynastic capital. The Charminar, a 16th-century mosque whose 4 arches support towering minarets, is an old city landmark near the long-standing Laad Bazaar.</em></strong></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-28 16:37:38', '2021-03-25 05:23:00'),
	(107, 'Ludhiana', 'Mussoorie', 'LUDHIANA-DHANAULTI -MUSSOORIE', '1585545408.png', NULL, 'bn1585545408.png', NULL, 4, '<p><i><strong>Dhanaulti is a hill station situated in the foothills of the Garhwal Himalayan range located 24 km from the hill station of Mussoorie(Queen Of Hills)</strong></i></p>', 'National', '3', '1', '0', NULL, '1', NULL, '1', '2020-03-30 10:46:49', '2021-03-23 09:36:39'),
	(108, 'Ludhiana', 'Nainital', 'KHANNA-CORBETT-NAINITAL', '1585546835.png', NULL, 'bn1585546835.png', NULL, 4, '<p><i><strong>Jim Corbett National Park is a forested wildlife sanctuary in northern Indiaâ€™s Uttarakhand State. Rich in flora and fauna, itâ€™s known for its Bengal tigers..Nainital is a Himalayan resort town in the Kumaon region of Indiaâ€™s Uttarakhand state, at an elevation of roughly 2,000m.&nbsp;</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-30 11:10:35', '2021-03-23 09:36:39'),
	(109, 'Ludhiana', 'Goa', 'LUDHIANA-MUMBAI-ESSEL WORLD-GOA', '1585549085.jpeg', NULL, 'bn1585549085.jpeg', NULL, 6, '<p><i><strong>Mumbai (formerly called Bombay) is a densely populated city on Indiaâ€™s west coast. A financial center, it\'s India\'s largest city. On the Mumbai Harbour waterfront stands the iconic Gateway of India stone arch, built by the British Raj in 1924.&nbsp;</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-30 11:48:05', '2021-03-23 09:36:39'),
	(110, 'Ludhiana', 'Goa', 'LUDHIANA-MUMBAI-ESSEL WORLD-GOA', '1585550979.jpeg', NULL, 'bn1585550980.jpeg', NULL, 6, '<p><i><strong>Mumbai (formerly called Bombay) is a densely populated city on Indiaâ€™s west coast. A financial center, it\'s India\'s largest city. On the Mumbai Harbour waterfront stands the iconic Gateway of India stone arch, built by the British Raj in 1924.</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-30 12:19:40', '2021-03-23 09:36:39'),
	(111, 'Ludhiana', 'Coimbatore', 'LUDHIANA-HYDERABAD-BANGALORE-MYSORE-OOTY', '1585552165.jpeg', NULL, 'bn1585552165.jpeg', NULL, 9, '<p><i><strong>Bengaluru (also called Bangalore) is the capital of India\'s southern Karnataka state. The center of India\'s high-tech industry, the city is also known for its parks and nightlife. By Cubbon Park, Vidhana Soudha is a Neo-Dravidian legislative building.</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-30 12:39:25', '2021-03-23 09:36:39'),
	(112, 'Hyderabad', 'America', 'HYDERABAD-ORLANDOâ€“UNIVERSAL STUDIOS-SEA WORLD-WASHINGTON DC-BUFFALO-NEW YORK', '1585631817.jpeg', NULL, 'bn1585631817.jpeg', NULL, 10, '<p><i><strong>The U.S. is a country of 50 states covering a vast swath of North America, with Alaska in the northwest and Hawaii extending the nationâ€™s presence into the Pacific Ocean. Major Atlantic Coast cities are New York, a global finance and culture center, and capital Washington, DC. Midwestern metropolis Chicago is known for influential architecture and on the west coast, Los Angeles\' Hollywood is famed for filmmaking.</strong></i></p>', 'International', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-31 10:46:57', '2021-03-23 09:36:39'),
	(113, 'Delhi', 'America', 'DELHI-ORLANDOâ€“UNIVERSAL STUDIOS-WASHINGTON DC-BUFFALO-NEW YORK', '1585632507.jpeg', NULL, 'bn1585632507.jpeg', NULL, 10, '<p><i><strong>The U.S. is a country of 50 states covering a vast swath of North America, with Alaska in the northwest and Hawaii extending the nationâ€™s presence into the Pacific Ocean. Major Atlantic Coast cities are New York, a global finance and culture center, and capital Washington, DC. Midwestern metropolis Chicago is known for influential architecture and on the west coast, Los Angeles\' Hollywood is famed for filmmaking.</strong></i></p>', 'International', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-31 10:58:27', '2021-03-23 09:36:39'),
	(114, 'Delhi', 'Delhi', 'DAY RETURN TOUR TO CHILLOUT ZONE, ROHTAK', '1585635456.png', NULL, 'bn1585635456.png', NULL, 1, '<p><i><strong>An adventure park is a place which can contain a wide variety of elements, including but not limited to, rope climbing exercises, obstacle courses, bouldering, rock climbing, target oriented activities, and zip-lines.&nbsp;</strong></i></p>', 'National', '0', '1', NULL, NULL, '1', NULL, '1', '2020-03-31 11:47:36', '2021-03-23 09:36:39'),
	(115, 'Delhi', 'Sonipath', 'DAY RETURN TOUR TO CHOWKI DHANI, SONIPAT', '1585636289.png', NULL, 'bn1585636289.png', NULL, 1, '<p><i><strong>Sonipat is a city and a </strong></i><a href="https://en.wikipedia.org/wiki/Municipal_Corporation"><i><strong>Municipal Corporation</strong></i></a><i><strong> in </strong></i><a href="https://en.wikipedia.org/wiki/Haryana"><i><strong>Haryana</strong></i></a><i><strong> </strong></i><a href="https://en.wikipedia.org/wiki/States_and_territories_of_India"><i><strong>state</strong></i></a><i><strong> of India. It comes under the </strong></i><a href="https://en.wikipedia.org/wiki/National_Capital_Region"><i><strong>National Capital Region</strong></i></a><i><strong> and is around 20 kilometres (12&nbsp;mi) from </strong></i><a href="https://en.wikipedia.org/wiki/Delhi"><i><strong>Delhi</strong></i></a><i><strong>. It is also around 214&nbsp;km(128 miles) southwest of </strong></i><a href="https://en.wikipedia.org/wiki/Chandigarh"><i><strong>Chandigarh</strong></i></a><i><strong>, the state capital.&nbsp;</strong></i></p>', 'National', '0', '1', NULL, NULL, '1', NULL, '1', '2020-03-31 12:01:29', '2021-03-23 09:36:39'),
	(116, 'Ranchi', 'Jaipur', 'JHARKHAND-DELHI-KOD- AKSHARDHAM-JAIPUR', '1585655497.png', NULL, 'bn1585655497.png', NULL, 5, '<p><i><strong>Jaipur is the capital of Indiaâ€™s Rajasthan state. It evokes the royal family that once ruled the region and that, in 1727, founded what is now called the Old City, or â€œPink Cityâ€ for its trademark building color.</strong></i></p>', 'National', '3', '1', '1', '1', '1', NULL, '1', '2020-03-31 17:21:38', '2021-03-23 09:36:39'),
	(117, 'Jhansi', 'Amritsar', 'JHANSI-AMRITSAR WAGAH BORDER', '1585656101.png', NULL, 'bn1585656101.png', NULL, 4, '<p><i><strong>Amritsar is a city in the northwestern Indian state of Punjab, 28 kilometers from the border with Pakistan. At the center of its walled old town, the gilded Golden Temple (Harmandir Sahib) is the holiest gurdwara (religious complex) of the Sikh religion.</strong></i></p>', 'National', '3', '1', '1', NULL, '1', NULL, '1', '2020-03-31 17:31:42', '2021-03-23 09:36:39'),
	(118, 'Hyderabad', 'Manali', 'HYDERABAD-DELHIâ€“CHANDIGARHâ€“MANALI-KULLU', '1585657370.jpeg', NULL, 'bn1585657370.jpeg', NULL, 5, '<p><i><strong>Manali is a high-altitude Himalayan resort town in Indiaâ€™s northern Himachal Pradesh state. It has a reputation as a backpacking center and honeymoon destination. Set on the Beas River, itâ€™s a gateway for skiing in the Solang Valley and trekking in Parvati Valley.&nbsp;</strong></i></p>', 'National', '3', '1', NULL, '1', '1', NULL, '1', '2020-03-31 17:52:50', '2021-03-23 09:36:39'),
	(140, 'Delhi', 'Jaipur', 'Delhi-jaipur-test', 'environment-earth-day-hands-trees-growing-seedlings-bokeh-green-background-female-hand-holding-tree-nature-field-gra-130247647jpg-1623307740908964.jpeg', 'environment-earth-day-hands-trees-growing-seedlings-bokeh-green-background-female-hand-holding-tree-nature-field-gra-130247647.jpg', 'featnature02jpgcrdownload-162330774249473.octet-stream', 'FeatNature02.jpg.crdownload', 2, '<p>Test</p>', 'National', '3', '1', '0', '1', '1', NULL, '1', NULL, '2021-06-10 06:54:47');
INSERT INTO `itinerarydays` (`id`, `itinerary_id`, `day`, `day_source`, `day_destination`, `day_description`, `status`, `created_at`, `updated_at`) VALUES
	(394, 104, '1', 'Ambala', 'Jaipur', '<ul><li>Leave Ambala for Jaipur by Train.</li><li>&nbsp;Overnight Journey in the train.</li></ul>', '1', '2020-03-28 15:45:28', '2021-03-23 09:40:50'),
	(395, 104, '2', 'Jaipur', 'Jaipur', '<ul><li>Arrive Jaipur transfer to the hotel for wash and change.&nbsp;</li><li>After breakfast visit <i><strong>City Palace, Hawa Mahal, Jantar Mantar.&nbsp;</strong></i></li><li>After lunch visit <i><strong>Amber Fort.</strong></i>&nbsp;</li><li>Dinner at a restaurant, overnight stay at hotel in Jaipur.</li></ul>', '1', '2020-03-28 15:45:28', '2021-03-23 09:40:50'),
	(396, 104, '3', 'Jaipur', 'Jodhpur', '<ul><li>After breakfast leave Jaipur by Ac bus/express train for Jodhpur. Arrive Jodhpur.&nbsp;</li><li>After lunch visit <i><strong>Mehrangarh Fort, Mandore Garden.</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Jodhpur.</li></ul>', '1', '2020-03-28 15:45:28', '2021-03-23 09:40:50'),
	(397, 104, '4', 'Jodhpur', 'Jaisalmer', '<ul><li>After breakfast leave Jodhpur for Jaisalmer. Arrive Jaisalmer.</li><li>After lunch leave for <i><strong>Sam sand dunes, Camel safari, Cultural evening at dunes.</strong></i> Dinner at dunes.&nbsp;</li><li>Overnight stay at hotel in Jaisalmer.</li></ul>', '1', '2020-03-28 15:45:28', '2021-03-23 09:40:50'),
	(398, 104, '5', 'Jaisalmer', 'Jodhpur', '<ul><li>After breakfast visit <i><strong>Jaisalmer Fort, Patwon ki Haveli, Gadi Sar Lake.</strong></i> &nbsp;</li><li>After lunch leave for Jodhpur. Arrive Jodhpur transfer to the hotel.&nbsp;</li><li>Dinner at a restaurant, overnight stay at hotel in Jodhpur.</li></ul>', '1', '2020-03-28 15:45:28', '2021-03-23 09:40:50'),
	(399, 104, '6', 'Jodhpur', 'Ambala', '<ul><li>After breakfast leave Jodhpur for Ambala by Express train.&nbsp;</li><li>Overnight journey in train.</li></ul><p>&nbsp;</p>', '1', '2020-03-28 15:45:28', '2021-03-23 09:40:50'),
	(400, 104, '7', 'Ambala', 'Ambala', '<ul><li>Arrive Ambala.&nbsp;</li></ul>', '1', '2020-03-28 15:45:28', '2021-03-23 09:40:50'),
	(456, 113, '1', 'Delhi', 'Orlando', '<p>Leave Delhi International Airport for Orlando (Florida) United State.</p>', '1', '2020-03-31 10:58:27', '2021-03-23 09:40:50'),
	(457, 113, '2', 'Orlando', 'Orlando', '<ul><li>Arrive Orlando. After emigration clearance, transfer to coach for lunch at Indian restaurant, check in the hotel.</li><li>Day free for independent activities.</li><li>Dinner at an Indian restaurant. Overnight stay in the hotel at Orlando.</li></ul>', '1', '2020-03-31 10:58:27', '2021-03-23 09:40:50'),
	(458, 113, '3', 'Orlando', 'Orlando', '<ul><li>After breakfast, proceed to <i><strong>Kennedy Space Center.</strong></i> After registration, visit Hall of fame where students learn about the history of Aeronautics.</li><li>After lunch visit <i><strong>the Rocket launching site</strong></i>, where the students get to experience the space shuttle launch.</li><li>Dinner at an Indian Restaurant. Overnight stay in the hotel at Orlando.</li></ul>', '1', '2020-03-31 10:58:27', '2021-03-23 09:40:50'),
	(459, 113, '4', 'Orlando', 'Orlando', '<ul><li>Early breakfast leave for <i><strong>Universal Studios.</strong></i> Lunch at Universal Studios. Enjoy the thrilling rides.</li><li>Dinner at an Indian restaurant. Overnight stay in the hotel at Orlando.</li></ul>', '1', '2020-03-31 10:58:27', '2021-03-23 09:40:50'),
	(460, 113, '5', 'Orlando', 'Orlando', '<ul><li>Early breakfast leave for Sea World. Arrive <i><strong>Sea-World. Thrills of taking on blazing fast floorless roller coaster-Kraken! Enjoy memorable live shows and unique attractions such as the latest addition of Antarctica-Empire of the Penguin. Sea World is all about animals.</strong></i></li><li>Dinner at an Indian restaurant. Overnight stay in the hotel at Orlando.</li></ul>', '1', '2020-03-31 10:58:27', '2021-03-23 09:40:50'),
	(461, 113, '6', 'Orlando', 'Washington', '<ul><li>Early morning transfer to Orlando Airport to board the flight for Washington, D.C. Arrive Washington DC.</li><li>After lunch visit <i><strong>Smithsonian Air and Space Center to have glimpse of various significant inventions in the aeronautical science.</strong></i></li><li>Dinner at an Indian restaurant. Overnight stay in the hotel at Washington DC.</li></ul>', '1', '2020-03-31 10:58:28', '2021-03-23 09:40:50'),
	(462, 113, '7', 'Washington', 'Buffalo', '<ul><li>After breakfast leave Washington DC for Buffalo by AC coach. Arrive Buffalo and transfer to the hotel.</li><li>In the evening visit <i><strong>the world famous Niagara Falls (USA side).&nbsp;</strong></i></li><li>Dinner at an Indian restaurant. Overnight stay in the hotel at Buffalo.</li></ul>', '1', '2020-03-31 10:58:28', '2021-03-23 09:40:50'),
	(463, 113, '8', 'Buffalo', 'New York', '<ul><li>After breakfast leave Buffalo for New York by AC coach. Arrive New York.</li><li>After lunch visit <i><strong>Empire State Building the busiest Manhattan Street Fifth Avenue, Times Square.</strong></i></li><li>Dinner at an Indian restaurant. Overnight stay in the hotel at New York.</li></ul>', '1', '2020-03-31 10:58:28', '2021-03-23 09:40:50'),
	(464, 113, '9', 'New York', 'Delhi', '<ul><li>After breakfast visit <i><strong>Statue of Liberty (In long Island).</strong></i></li><li>After lunch free for shopping in the evening.</li><li>After early dinner transfer to John F Kennedy airport to board the flight for Delhi.</li></ul>', '1', '2020-03-31 10:58:28', '2021-03-23 09:40:50'),
