	(471, 112, '6', 'Orlando', 'Washington', '<ul><li>Early morning transfer to Orlando Airport to board the flight for Washington, D.C. Arrive Washington DC.&nbsp;</li><li>After lunch visit <i><strong>Smithsonian Air and Space Center to have glimpse of various significant inventions in the aeronautical science.</strong></i>&nbsp;</li><li>Dinner at an Indian restaurant. Overnight stay in the hotel at Washington DC.</li></ul>', '1', '2020-03-31 10:58:33', '2021-03-23 09:40:50'),
