	(493, 101, '1', 'Ahmedabad', 'Ahmedabad', '<ul><li>After Breakfast leave for Modhera by AC bus. Arrive Modhera to visit <i><strong>the famous Sun Temple</strong></i>. Lunch at Patan.</li><li>After lunch visit <i><strong>RANI KI VAV.</strong></i></li><li>In the evening return back to Ahmedabad. Arrive Ahmedabad.</li></ul>', '1', '2020-03-31 17:55:32', '2021-03-23 09:40:50'),
	(498, 103, '1', 'Surat', 'Mysore', '<ul><li>Leave Surat by flight for Bangalore. Arrive Bangalore and leave for Mysore by A/c bus.</li><li>After lunch visit <i><strong>MYSORE PALACE,</strong></i> <i><strong>CHAMUNDI HILL and</strong></i> <i><strong>BRINDAVAN GARDENS.</strong></i></li><li>Dinner and overnight stay at hotel in Mysore.</li></ul>', '1', '2020-04-05 13:33:12', '2021-03-23 09:40:50'),
	(499, 103, '2', 'Mysore', 'Ooty', '<ul><li>After breakfast leave Mysore for Ooty. Arrive Ooty.</li><li>After lunch visit <i><strong>OOTY LAKE, BOTANICAL GARDEN</strong></i><strong>.</strong></li><li>Dinner and overnight stay at hotel in Ooty.</li></ul>', '1', '2020-04-05 13:33:13', '2021-03-23 09:40:50'),
	(500, 103, '3', 'Ooty', 'Mysore', '<ul><li>After breakfast visit <i><strong>DODA PETA PEAK.</strong></i></li><li>After lunch leave Ooty for Mysore. Arrive Mysore and transfer to the hotel.</li><li>Dinner and overnight stay at hotel in Mysore.</li></ul>', '1', '2020-04-05 13:33:13', '2021-03-23 09:40:50'),
	(501, 103, '4', 'Mysore', 'Bangalore', '<ul><li>After breakfast leave Mysore for Bangalore. Arrive Bangalore.</li><li>After lunch visit <i><strong>BULL TEMPLE and</strong></i> <i><strong>SCIENCE MUSEUM</strong></i>, where you can discover the history of space exploration &nbsp;and learn about various scientific explorations.</li><li>Dinner and overnight stay at hotel in Bangalore.</li></ul>', '1', '2020-04-05 13:33:13', '2021-03-23 09:40:50'),
