	(509, 116, '2', 'Delhi', 'Delhi', '<ul><li>After breakfast visit <i><strong>Qutub Minar and KINGDOM OF DREAM (Gurgaon).</strong></i></li><li>Dinner and overnight stay at hotel in Delhi.</li></ul><p>&nbsp;</p>', '1', '2020-04-05 14:18:13', '2021-03-23 09:40:50'),
	(510, 116, '3', 'Delhi', 'Jaipur', '<ul><li>Rise up early transfer to the railway station to board the <strong>AJMER SHTBDI (12015) at 06:05</strong> for Jaipur.</li><li>Arrive Jaipur. After lunch visit <i><strong>Hawal Mahal (from outside) and City Palace.</strong></i></li><li>Dinner and overnight stay at hotel in Jaipur.</li></ul>', '1', '2020-04-05 14:18:13', '2021-03-23 09:40:50'),
	(511, 116, '4', 'Jaipur', 'Delhi', '<ul><li>After breakfast visit <i><strong>Amber Palace</strong></i>. Return back to hotel for lunch.&nbsp;</li><li>After lunch visit <i><strong>Albert Hall Museum </strong></i>and transfer to the railway station and leave for Delhi by <strong>AJMER SHTBDI (12016) at 17:50 hrs.</strong>&nbsp;</li><li>Arrive Delhi. Overnight stay in the hotel at Delhi.</li></ul><p>&nbsp;</p>', '1', '2020-04-05 14:18:13', '2021-03-23 09:40:50'),
	(512, 116, '5', 'Delhi', 'Ranchi', '<ul><li>After breakfast visit <i><strong>Akshardham Temple with Pradarshani.</strong></i>&nbsp;</li><li>After lunch visit <i><strong>India Gate (From Outside) </strong></i>and transfer to the airport to board the flight for Ranchi.&nbsp;</li><li>Arrive Ranchi.</li></ul>', '1', '2020-04-05 14:18:13', '2021-03-23 09:40:50'),
	(513, 50, '1', 'New Delhi', 'Rome', '<ul><li>Leave Delhi &nbsp; for <i><strong>Italy (Rome).</strong></i> On Arrival Italy International Airport, after clearance of customs and immigration transfer to hotel.</li><li>Dinner at a restaurant, overnight stay at hotel in Rome.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(514, 50, '2', 'Rome', 'Florence', '<ul><li>After breakfast visit <i><strong>Piazza Venezia Victor Emmanual.</strong></i> <i><strong>Further visit Vatican City,</strong></i> <i><strong>Here, visit Vatican Museum, Sistine Chapel and St. Peterâ€™s Basilica</strong></i>.</li><li>Drive to Pisa and visit <i><strong>the famous Field of Miracles</strong></i>. See the Baptistery and another architectural wonder- the Bell tower known as the Leaning tower of Pisa.&nbsp;</li><li>Dinner at a restaurant, overnight stay at hotel in Pisa/ Florence.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(515, 50, '3', 'Florence', 'Padova', '<ul><li>After breakfast check out from the hotel and drive to Venice.</li><li>After lunch enjoy the <i><strong>city tour &nbsp;which includes St. Markâ€™s Square, the very heart of Venice. See the Ducal Palace, the infamous Prison, Bridge of Sighs, the exquisite Clock Tower . Later return to hotel.</strong></i></li><li>Dinner at a restaurant. overnight stay at hotel in Venice/ Padova.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(516, 50, '4', 'Padova', 'Austria', '<ul><li>After breakfast check out from hotel and drive to Innsbruck in Austria&nbsp;</li><li>After lunch visit <i><strong>the Swarovski Crystals Museum, the amazing Crystal World Complex at Wattens.</strong></i> &nbsp;</li><li>Dinner at a restaurant, overnight stay at hotel in Innsbruck, Austria.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(517, 50, '5', 'Austria', 'Switzerland', '<ul><li>After breakfast check out from hotel, drive to Zurich.&nbsp;</li><li>After lunch visit <i><strong>St. Peterâ€™s Church with the largest clock face in Europe, the famous churches of Fraumunster, Grossmunster with its twin Romanesque towers.&nbsp;</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Zurich, Switzerland.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(518, 50, '6', 'Switzerland', 'Switzerland', '<ul><li>After breakfast visit <i><strong>Mt. Titlis with Ice-Flyer followed by a Lucerne City Tour .</strong></i></li><li>After enjoying in the snow and lunch visit to the enchanting beauty of Lucerne. <i><strong>The famous Lion Monument, Kappelbruck Bridge .</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Zurich, Switzerland.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(519, 50, '7', 'Switzerland', 'Paris', '<ul><li>After breakfast, check-out from the hotel and drive to Paris.</li><li>Lunch on the way. Pass the charming Swiss countryside, picturesque lakes, chalets and farms.</li><li>Arrive Paris and transfer to the hotel.</li><li>Dinner at a restaurant, overnight stay at hotel in Paris.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(520, 50, '8', 'Paris', 'Paris', '<ul><li>After breakfast visit <i><strong>the world-famous Eiffel Tower- the symbol of Paris.</strong></i></li><li>After lunch enjoy <i><strong>the stunning Seine River Cruise.</strong></i> Followed by visit to &nbsp;<i><strong>Arc de Triomphe the </strong></i>famous monuments in Paris, <i><strong>the Town Hall, National Assembly, Louvre, central landmark of Paris (from outside) and the famous Notre Dame Cathedral, one of the most famous cathedrals.</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Paris.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
	(521, 50, '9', 'Paris', 'Delhi', '<ul><li>After breakfast, check out from the hotel transfer to the airport.&nbsp;</li><li>To board the return flight with pleasant memories.&nbsp;</li><li>Arrive Delhi.</li></ul>', '1', '2020-04-05 14:40:02', '2020-04-05 14:40:02'),
