	(573, 51, '3', 'Rome', 'Florence', '<ul><li>After breakfast visit <i><strong>Piazza Venezia Victor Emmanual.</strong></i> <i><strong>Further visit Vatican City,</strong></i> <i><strong>Here, visit Vatican Museum, Sistine Chapel and St. Peterâ€™s Basilica</strong></i>.</li><li>Drive to Pisa and visit <i><strong>the famous Field of Miracles</strong></i>. See the Baptistery and another architectural wonder- the Bell tower known as the Leaning tower of Pisa.</li><li>Dinner at a restaurant, overnight stay at hotel in Pisa/ Florence.</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(574, 51, '4', 'Florence', 'Padova', '<ul><li>After breakfast check out from the hotel and drive to Venice.</li><li>After lunch visit <i><strong>city tour St. Markâ€™s Square, the very heart of Venice. See the Ducal Palace, the infamous Prison, Bridge of Sighs, the exquisite Clock Tower and the awe striking baroque splendor of St. Marks Basilica. Later return to hotel.</strong></i></li><li>Dinner at a restaurant. overnight stay at hotel in Venice/ Padova.</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(575, 51, '5', 'Padova', 'Austria', '<ul><li>After breakfast check out from hotel and drive to Innsbruck in Austria</li><li>After lunch visit <i><strong>the Swarovski Crystals Museum, the amazing Crystal World Complex at Wattens.</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Innsbruck, Austria.</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(576, 51, '6', 'Austria', 'Switzerland', '<ul><li>After breakfast check out from hotel, drive to Zurich.</li><li>After lunch visit <i><strong>St. Peterâ€™s Church with the largest clock face in Europe, the famous churches of Fraumunster, Grossmunster with its twin Romanesque towers.&nbsp;</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Zurich, Switzerland.</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(577, 51, '7', 'Switzerland', 'Switzerland', '<ul><li>After breakfast visit <i><strong>Mt. Titlis with Ice-Flyer followed by a Lucerne City Tour .</strong></i></li><li>After enjoying in the snow and lunch; visit the enchanting beauty of Lucerne. <i><strong>The famous Lion Monument, Kappelbruck Bridge .</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Zurich, Switzerland.</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(578, 51, '8', 'Switzerland', 'Paris', '<ul><li>After breakfast, check-out from the hotel and drive to Paris.</li><li>Lunch on the way. Pass the charming Swiss countryside, picturesque lakes, chalets and farms</li><li>Arrive Paris and transfer to the hotel.</li><li>Dinner at a restaurant, overnight stay at hotel in Paris.</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(579, 51, '9', 'Paris', 'Paris', '<ul><li>After breakfast visit <i><strong>the world-famous Eiffel Tower- the symbol of Paris.</strong></i></li><li>After lunch visit <i><strong>the stunning Seine River Cruise.</strong></i>Visit <i><strong>Arc de Triomphe the </strong></i>famous monuments in Paris, <i><strong>the Town Hall, National Assembly, Louvre, central landmark of Paris (from outside) and the famous Notre Dame Cathedral, one of the most famous cathedrals.</strong></i></li><li>Dinner at a restaurant, overnight stay at hotel in Paris.</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(580, 51, '10', 'Paris', 'Delhi', '<ul><li>After breakfast, check out from the hotel transfer to the airport.</li><li>To board the return flight with pleasant memories.</li><li>Arrive Delhi. Leave &nbsp;for Ludhiana by AC &nbsp;Coach. &nbsp;</li></ul>', '1', '2020-04-05 17:38:56', '2020-04-05 17:38:56'),
	(607, 107, '1', 'Ludhiana', 'Dhanaulti', '<ul><li>Leave Khanna,Ludhiana by AC bus at 06:00 hrs, for Dhanaulti Camp. Arrive Dhanaulti by &nbsp;lunch time.</li><li>After lunch meet and greet the Camp coordinator. The Camp Coordinator would guide you &nbsp;about the adventure activities and other team building activities. Bon fire in the evening.</li><li>Dinner and overnight stay at Camp in Dhanaulti.</li></ul>', '1', '2020-04-05 20:11:46', '2021-03-23 09:40:50'),
	(608, 107, '2', 'Dhanaulti', 'Dhanaulti', '<ul><li>After breakfast go for various team building activities like trust fall. <i><strong>Burma Bridge, Commando Net etc.</strong></i></li><li>After lunch engage yourself in other various kinds of activities like rope <i><strong>climbing, Commando Crawl etc.</strong></i></li><li>In the evening enjoy the tea and snacks with bonfire.</li><li>Dinner and overnight stay at Camp in Dhanaulti.</li></ul>', '1', '2020-04-05 20:11:46', '2021-03-23 09:40:50'),
	(609, 107, '3', 'Dhanaulti', 'Mussoorie', '<ul><li>After breakfast leave Dhanaulti for Mussoorie.</li><li>Arrive Mussoorie visit <i><strong>the Mall, trek to Gun Hill.&nbsp;</strong></i></li><li>Dinner and overnight stay at hotel in Mussoorie.</li></ul>', '1', '2020-04-05 20:11:46', '2021-03-23 09:40:50'),
	(610, 107, '4', 'Mussoorie', 'Ludhiana', '<ul><li>After breakfast leave Mussoorie for <i><strong>Kempty falls </strong></i>return to hotel.</li><li>After lunch leave Mussoorie for Khanna,Ludhiana by AC Bus.</li><li>Arrive Khanna,Ludhiana</li></ul>', '1', '2020-04-05 20:11:46', '2021-03-23 09:40:50'),
	(620, 57, '1', 'Delhi', 'Delhi', '<ul><li><i><strong>6:00-9:30 hrs: Delhi- Neemrana Fort Palace:-</strong></i> Leave Delhi for Neemrana Fort Palace by AC bus at 6:30 am . Arrive Neemrana Fort Palace at 9:30 approx.</li><li><i><strong>10:00-12:00 hrs: Flying Fox Zipline Tour:-</strong></i> Enjoy the Flying fox and Zip line.&nbsp;</li><li><i><strong>12:00-13:00 hrs: Explore Neemrana Fort Palace:- </strong></i>This painstakingly preserved heritage hotel will take you back to medieval times. Thereâ€™s an audio tour to guide you around the 14 tiers of 543 year old architecture, or you can simply take a stroll and discover as you go. &nbsp;Neemrana Fort Palace Built into the 2-billion-year-old Aravalli hills, itâ€™s little wonder this 15th century.</li><li><i><strong>13:00-14:00 hrs: Lunch time:- </strong>Lunch at restaurant/hotel at Neemrana.</i></li><li><i><strong>14:30-15:30 hrs: Neemrana Stepwell:- </strong></i>After lunch trek to &nbsp;stepwell, this stepwell is a hidden jewel of Rajasthani architecture. &nbsp;Neemrana stepwell 9 levels deep,&nbsp;</li><li><i><strong>15:30-16:00 hrs: Time for Hi Tea with Snack:- </strong></i>Enjoy the hi tea with snack.</li><li><i><strong>16:00-19:30 hrs: Departure:- </strong></i>In the evening return back to Delhi. Arrive Delhi at 19:30 hrs approx.</li></ul>', '1', '2020-04-05 22:17:16', '2021-03-23 09:40:50'),
	(621, 52, '1', 'Delhi', 'Dubai', '<ul><li>Leave Delhi by flight for Dubai/Sharjah. Arrive Dubai.&nbsp;</li><li>In the evening enjoy dinner at <i><strong>Luxurious Dhow Cruise and adore the panoramic view of Dubai city from Dubai Creek.&nbsp;</strong></i></li><li>The dinner is accompanied by the blend of contemporary music. Overnight stay at hotel in Dubai.</li></ul>', '1', '2020-04-05 22:24:42', '2020-04-05 22:24:42'),
	(622, 52, '2', 'Dubai', 'Dubai', '<ul><li>After breakfast visit <i><strong>The most magnificent Jumeirah Mosque, Palm Jumeriah, Jumeriah Public Beach, Burj Al Arab most luxurious hotel and tallest standing hotel in the world. Sheikh\'s Mohamed palace, Deira Towers, Dubai Museum housed in the Al Fahidi Fort, built in 1800.</strong></i></li><li>&nbsp;Overnight stay at hotel in Dubai.</li></ul><p>&nbsp;</p>', '1', '2020-04-05 22:24:42', '2020-04-05 22:24:42'),
	(623, 52, '3', 'Dubai', 'Dubai', '<ul><li>After breakfast visit <i><strong>Ski Dubai sprawling 3000 sq meters indoor snow theme park one of its kind and the largest in the world.</strong></i>&nbsp;</li><li>After lunch surprise for students visiting <i><strong>Desert Safari</strong></i> there to explore myriad colours of desert and feel the thrill Hop inside the 4X4 as it rides through the sand dunes and deep inside the desert Conservation Reserve.</li><li>Dinner at dunes. Overnight stay at hotel in Dubai.</li></ul>', '1', '2020-04-05 22:24:42', '2020-04-05 22:24:42'),
