	(674, 73, '2', 'Dhanaulti', 'Dhanaulti', '<ul><li>After breakfast go for <i><strong>various team building activities like trust fall Burma Bridge, Commando Net etc.</strong></i>&nbsp;</li><li>After lunch <i><strong>do the other various kinds of activities like Rope Climbing, Commando Crawl River Crossing, and Rock Climbing etc.</strong></i>&nbsp;</li><li>Evening enjoy the tea and snacks with bonfire. Dinner and overnight stay at tents in Dhanaulti.</li></ul>', '1', '2020-04-06 10:42:15', '2021-03-23 09:40:50'),
	(675, 73, '3', 'Dhanaulti', 'Delhi', '<ul><li>After breakfast rest in the tent.&nbsp;</li><li>After lunch leave Dhanaulti for Dehradun to board the <strong>Shatabdi Express at 1700 hrs</strong> for Delhi.&nbsp;</li><li>Arrive New Delhi in the evening.</li></ul>', '1', '2020-04-06 10:42:15', '2021-03-23 09:40:50'),
	(676, 74, '1', 'Delhi', 'Mussoorie', '<ul><li>Leave Delhi by &nbsp;<strong>Shatabdi Express at 06:50 hrs</strong> for Dehradun. Arrive Dehradun.</li><li>After lunch leave for Mussoorie. Arrive Mussoorie transfer to hotel.</li><li>In the evening visit the <i><strong>Mall Road.&nbsp;</strong></i></li><li>Dinner and overnight stay at hotel in Mussoorie.</li></ul>', '1', '2020-04-06 10:43:09', '2021-03-23 09:40:50'),
	(677, 74, '2', 'Mussoorie', 'Mussoorie', '<ul><li>After breakfast visit <i><strong>Kempty Falls, Company Bagh.</strong></i></li><li>After lunch <strong>trek to gun hill. In the evening stroll at the Mall.&nbsp;</strong></li><li>Dinner and overnight stay at hotel in Mussoorie.</li></ul>', '1', '2020-04-06 10:43:09', '2021-03-23 09:40:50'),
	(678, 74, '3', 'Mussoorie', 'Delhi', '<ul><li>After breakfast free for shopping and leave Mussoorie for Dehradun.&nbsp;</li><li>Leave Dehradun by <strong>Shatabdi Express at 1700 hrs</strong> for Delhi.&nbsp;</li><li>Arrive New Delhi in the evening.</li></ul>', '1', '2020-04-06 10:43:09', '2021-03-23 09:40:50'),
	(679, 75, '1', 'Delhi', 'Ranikhet', '<ul><li>Leave Delhi by <strong>Shatadbi Exp. at 6:00 hrs.</strong> for Kathgodam. Arrive Kathgodam</li><li>Leave for Ranikhet. Arrive Ranikhet.</li><li>After lunch visit <i><strong>Apple Garden and Sadar Bazar.</strong></i></li><li>Evening enjoy the sizzling snacks with tea/coffee at bonfire.</li><li>Dinner and overnight stay at hotel int Ranikhet.</li></ul>', '1', '2020-04-06 10:43:49', '2021-03-23 09:40:50'),
