	(711, 83, '4', 'Kochi', 'Kochi', '<ul><li>After breakfast leave for Alleppey backwater. Arrive Alleppey and transfer to <strong>Cruise at Alleppey Backwater.</strong></li><li>After lunch visit <i><strong>Mullakkal Temple, Alleppey Beach.</strong></i> Leave Alleppey for Kochi.</li><li>Dinner and overnight stay at hotel in Kochi.</li></ul>', '1', '2020-04-06 11:04:46', '2021-03-23 09:40:51'),
