	(713, 84, '1', 'Delhi', 'Mumbai', '<ul><li>Leave Delhi by air for Mumbai. Arrive Mumbai.</li><li>After breakfast visit<i><strong> Gateway of India, Nariman point, Aquarium, Hanging Gardens.</strong></i></li><li>Dinner and overnight at hotel in Mumbai.</li></ul>', '1', '2020-04-06 11:06:10', '2021-03-23 09:40:51'),
