	(717, 84, '5', 'Goa', 'Delhi', '<ul><li>After breakfast visit <i><strong>Colangute, Baga, Vagator, Anjuna.</strong></i>&nbsp;</li><li>After lunch free for shopping.&nbsp;</li><li>In the evening board flight for Delhi.&nbsp;</li><li>Arrive Delhi.</li></ul>', '1', '2020-04-06 11:06:10', '2021-03-23 09:40:51'),
	(718, 85, '1', 'Delhi', 'Jamnagar', '<ul><li>Leave Delhi by Air for Ahemdabad and transfer to the Ac bus proceed to Jamnagar.</li><li>After lunch <i><strong>visit Lakhota Lake &amp; Lakhota Museum.</strong></i></li><li>Evening, visit<i><strong> Bala Hanuman Temple.</strong></i></li><li>Dinner and overnight stay at hotel in Jamnagar.</li></ul>', '1', '2020-04-06 11:07:56', '2021-03-23 09:40:51'),
	(719, 85, '2', 'Jamnagar', 'Dwaraka', '<ul><li>After breakfast, leave for Dwarka. Arrive Dwarka and visit<i><strong> Dwarkadeesh Temple, Gomti river</strong></i><strong>, </strong><i><strong>later leave to visit Nageshwar Jyotirling, Gopi Talav, Bet Dwarka, and on way back do visit Rukmani Temple.</strong></i></li><li>In the evening attend <i><strong>Aarti at Dwarikadhish Temple.</strong></i></li><li>Dinner and overnight stay at hotel in Dwarka.</li></ul>', '1', '2020-04-06 11:07:56', '2021-03-23 09:40:51'),
	(720, 85, '3', 'Dwaraka', 'Somnath', '<ul><li>After breakfast leave for Porbandar. Arrive Porbandar and visit <i><strong>Kirti Mandir.</strong></i></li><li>After lunch leave for Somnath on arrival visit <i><strong>Bhalka Tirth, Triveni Ghat &amp; Somnath Temple.</strong></i></li><li>In the evening <i><strong>attend Aarti and later watch light and Sound show.</strong></i></li><li>Dinner and overnight stay at hotel in Somnath.</li></ul>', '1', '2020-04-06 11:07:56', '2021-03-23 09:40:51'),
	(721, 85, '4', 'Somnath', 'Gir Wildlife Sanctuary', '<ul><li>After early breakfast leave for Gir and visit <i><strong>beach town Diu, St. Paul\'s Church, Diu Museum and Diu Fort, Nagoa Beach.</strong></i></li><li>After lunch visit&nbsp;<i><strong>Sasangir, is the home of the Asiatic Lion, &nbsp;Gir Interpretation Zone at Devaliya or Take evening Jungle Safari.&nbsp;</strong></i></li><li>Dinner and overnight stay at hotel in Gir.</li></ul>', '1', '2020-04-06 11:07:56', '2021-03-23 09:40:51'),
	(722, 85, '5', 'Gir', 'Delhi', '<ul><li>After breakfast, leave for Ahmadabad. Lunch on the way.&nbsp;</li><li>Arrive Ahmedabad and transfer to the airport to board the flight for Delhi.</li></ul>', '1', '2020-04-06 11:07:56', '2021-03-23 09:40:51'),
	(723, 114, '1', 'Delhi', 'Delhi', '<ul><li>Leave school <i><strong>at 07:30 hrs for Chillout Zone, Rohtak.</strong></i> Arrive Chillout Zone and enjoy Tug of War, Mini Golf, Commando Net, Sack Race, Pittoo, Kanche, Lattu, Pressur Rocket, Chulha Chowki, Pottery, Mutka Fod and many more.&nbsp;</li><li>Lunch at Chillout Zone.&nbsp;</li><li>Leave for School in the evening.</li></ul>', '1', '2020-04-06 11:08:31', '2021-03-23 09:40:51'),
	(724, 115, '1', 'Delhi', 'Chowki Dhani', '<ul><li>Leave school by bus at 08:00 hrs for Chowkidhani, Sonipat. <i><strong>The Chowkhidhani</strong></i> Village has been the mirror of Rajasthani culture, we seen there Photo Studio with traditional look, National Art, Craft Market showing village culture, life style with dining hall renowned for the mouthwatering and typical Rajasthani food. The artificial forest with roar sounds of animals and tribes (only three rides complimentary), boating, horse riding, camel riding. &nbsp;</li><li>Lunch at Chowkidhani Sonipat.&nbsp;</li><li>Leave for school at 14:00 hrs. Arrive school at 16:00 hrs.</li></ul>', '1', '2020-04-06 11:08:56', '2021-03-23 09:40:51'),
	(725, 37, '1', 'Hyderabad', 'Ahmedabad', '<ul><li>Assemble at the airport to leave for Ahmedabad.</li><li>Arrive Ahmedabad and leave for Modhera.</li><li>Arrive Modhera to visit the <i><strong>famous Sun Temple and RANI KI VAV</strong></i>.</li><li>In the evening return back to Ahmedabad.</li><li>Dinner and overnight stay at hotel in Ahmedabad.</li></ul><p>&nbsp;</p>', '1', '2020-04-06 11:11:20', '2020-04-06 11:11:20'),
