	(727, 37, '3', 'Mount Abu', 'Udaipur', '<ul><li>After breakfast visit <i><strong>Brahma Kumari World Spiritual University, Dilwara Jain temple, Adhar Devi temple.&nbsp;</strong></i></li><li>After Lunch, leave for Udaipur. &nbsp;Arrive Udaipur, <i><strong>Free for Leisure.</strong></i></li><li>Dinner and overnight stay at hotel in Udaipur.</li></ul>', '1', '2020-04-06 11:11:20', '2020-04-06 11:11:20'),
