	(857, 110, '3', 'Mumbai', 'Goa', '<ul><li>After breakfast visit <i><strong>â€˜Essel Worldâ€™&nbsp;is India\'s largest amusement and theme park.</strong></i></li><li>After early dinner leave Mumbai by <strong>Konkan Kanya Exp at 23.05 hrs. for Goa.</strong></li><li>Overnight journey in the train.</li></ul>', '1', '2020-04-06 14:53:02', '2021-03-23 09:40:51'),
	(858, 110, '4', 'Goa', 'Goa', '<ul><li>Arrive Goa (Madgaon) at 12:30 hrs and transfer to the hotel.</li><li>After lunch visit <i><strong>Dona Paula, Miramar Beach.</strong></i></li><li>In the evening <i><strong>Boat Cruise at Mandovi River.</strong></i></li><li>Dinner and overnight stay at hotel in Goa.</li></ul>', '1', '2020-04-06 14:53:02', '2021-03-23 09:40:51'),
	(859, 110, '5', 'Goa', 'Goa', '<ul><li>After breakfast visit <i><strong>Aguada Fort, Sc Cathedral, Shri Mangueshi, Basilica of Bom Jesus, Colva beach.</strong></i></li><li>After lunch visit <i><strong>Colangute, Baga, Vagator, Anjuna.</strong></i></li><li>Dinner and overnight stay at hotel in Goa.</li></ul>', '1', '2020-04-06 14:53:02', '2021-03-23 09:40:51'),
	(860, 110, '6', 'Goa', 'Ludhiana', '<ul><li>After breakfast leave Goa by air for Delhi. Arrive Delhi and transfer to the New Delhi Railway Station.&nbsp;</li><li>Leave Delhi by <i><strong>Amritsar Shatabdi Express at 16:30 hrs</strong></i> for Ludhiana.&nbsp;</li><li>Arrive Ludhiana in the evening.</li></ul>', '1', '2020-04-06 14:53:02', '2021-03-23 09:40:51'),
	(861, 111, '1', 'Ludhiana', 'Delhi', '<ul><li>Leave Khanna,Ludhiana by bus for Sirhind Jn. &nbsp;Leave Sirhind Jn. for Delhi by <strong>Shatabdhi Exp at 07:50 hrs.</strong></li><li>After lunch visit <i><strong>Akshardham temple, Exhibition at Akshardam</strong></i> .</li><li>Dinner and overnight stay at hotel in Delhi.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(862, 111, '2', 'Delhi', 'Hyderabad', '<ul><li>Leave Delhi by Air for Hyderabad. Arrive Hyderabad and transfer to hotel.</li><li>After lunch visit <i><strong>Birla Mandir, Charminar, Salarjung Museum.</strong></i></li><li>In the evening <i><strong>sound and light show at Golcunda fort.</strong></i></li><li>Dinner and overnight stay at hotel in Hyderabad.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(863, 111, '3', 'Hyderabad', 'Bangalore', '<ul><li>After breakfast visit <i><strong>Ramoji Film City, one of the main centre for shooting films and serial in India.</strong></i>&nbsp;</li><li>Leave Hyderabad for Bangalore by A/c Bus.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(864, 111, '4', 'Bangalore', 'Bangalore', '<ul><li>Arrive Bangalore and transfer to the hotel.</li><li>After breakfast visit <i><strong>Bull Temple, Vidhan Shoudh, Lal Bagh, Science Museum, Tipuâ€™s Summer Palace.</strong></i></li><li>In the evening visit <i><strong>Iskcon Temple.&nbsp;</strong></i></li><li>Dinner and overnight stay at hotel in Bangalore.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(865, 111, '5', 'Bangalore', 'Bangalore', '<ul><li>After breakfast visit to <i><strong>Wonder La the one of the best amusement park in Bangalore.</strong></i></li><li>Eevening free for shopping at Bangalore.</li><li>Dinner and overnight stay at hotel in Bangalore.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(866, 111, '6', 'Bangalore', 'Mysore', '<ul><li>After breakfast leave Bangalore for Mysore. Arrive Mysore and transfer to the hotel.</li><li>After lunch visit <i><strong>Mysore Palace, Chamundi Hill, Brindavan &nbsp;Gardens.</strong></i></li><li>Dinner and overnight stay at hotel in Mysore.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(867, 111, '7', 'Mysore', 'Ooty', '<ul><li>After breakfast leave Mysore for Ooty. Arrive Ooty and transfer to hotel.</li><li>After lunch visit <i><strong>Botanical garden, Ooty lake.&nbsp;</strong></i></li><li>Dinner and overnight stay at hotel in Ooty.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(868, 111, '8', 'Ooty', 'Coimbatore', '<ul><li>After breakfast visit <i><strong>Doda Peta Peak.</strong></i></li><li>After lunch leave ooty for Coimbatore. Arrive Coimbatore and transfer to the hotel.</li><li>Dinner and overnight stay at hotel in Coimbatore.</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(869, 111, '9', 'Coimbatore', 'Ludhiana', '<ul><li>After breakfast leave Coimbatore by Air for Delhi.</li><li>Arrive Delhi and transfer to the railway station Leave Delhi by <strong>Amritsar Shatabdi Express at 16:30 hrs</strong> for Sirhind Jn.</li><li>Arrive Sirhind Jn. and transfer to the bus for Khanna.</li><li>Arrive Khanna,Ludhiana</li></ul>', '1', '2020-04-06 14:54:26', '2021-03-23 09:40:51'),
	(870, 47, '1', 'Delhi', 'Udaipur', '<ul><li>Leave Delhi <strong>(Nizamuddin Railway station)</strong> for Udaipur by <strong>Mewar Express (12963) at 19:00 PM.</strong>&nbsp;</li><li>Overnight journey in the train.</li></ul>', '1', '2020-04-06 14:56:08', '2020-04-06 14:56:08'),
	(871, 47, '2', 'Udaipur', 'Udaipur', '<ul><li>Arrive Udaipur, and transfer to hotel. After breakfast visit to <i><strong>City Palace, Jagdish Temple.</strong></i></li><li>After lunch visit<i><strong> Pratap Memorial, Saheliyonâ€“Ki-Bari.</strong></i></li><li>Dinner and overnight stay at hotel in Udaipur.</li></ul>', '1', '2020-04-06 14:56:08', '2020-04-06 14:56:08'),
	(872, 47, '3', 'Chittorgarh', 'Delhi', '<ul><li>After breakfast leave for Chittorgarh by Ac bus.&nbsp;</li><li>After lunch visit <i><strong>Padmini Palace, Victory Tower, Kalika Temple.</strong></i>&nbsp;</li><li>In the evening transfer to the railway station to board the <strong>Mewar Express (12964) at 20:30 PM for Delhi.</strong>&nbsp;</li><li>Overnight journey in the train.</li></ul>', '1', '2020-04-06 14:56:08', '2020-04-06 14:56:08'),
	(873, 47, '4', 'Chittorgarh', 'Delhi', '<ul><li>Arrive Delhi in the morning..</li></ul>', '1', '2020-04-06 14:56:08', '2020-04-06 14:56:08'),
	(874, 102, '1', 'Surat', 'Jaipur', '<ul><li>Leave Surat by <strong>DEE Garibrath (12216) at 16:00 hrs</strong> for Jaipur.</li><li>Overnight journey by train</li></ul><p>&nbsp;</p>', '1', '2020-04-06 14:57:54', '2021-03-23 09:40:51'),
	(875, 102, '2', 'Jaipur', 'Ranthambore', '<ul><li>Arrive Jaipur, after breakfast leave Jaipur for Ranthambore by A/c bus.</li><li>After lunch visit <i><strong>RANTHAMBHORE FORT and</strong></i> <i><strong>PADAM TALAO.</strong></i></li><li>Dinner and overnight stay at hotel in Ranthambore.</li></ul>', '1', '2020-04-06 14:57:54', '2021-03-23 09:40:51'),
	(876, 102, '3', 'Ranthambore', 'Jaipur', '<ul><li>Rise up early and leave for &nbsp;<i><strong>Wild life Safari to spot wild boars ,spotted deers and tigers.</strong></i></li><li>After lunch, leave for Jaipur. Arrive Jaipur and transfer to the hotel.</li><li>In evening visit to <i><strong>BIRLA MANDIR.</strong></i></li><li>Dinner and overnight stay at hotel in Jaipur.</li></ul>', '1', '2020-04-06 14:57:54', '2021-03-23 09:40:51'),
	(877, 102, '4', 'Jaipur', 'Surat', '<ul><li>After breakfast, visit <i><strong>AMBER FORT.</strong></i></li><li>After lunch visit <i><strong>CITY PALACE and HAWA MAHAL.</strong></i></li><li>Post Dinner leave for Surat by <strong>Ajmer-ASR Exp (19613) at 20:25 hrs.</strong></li><li>Overnight journey by train.</li></ul>', '1', '2020-04-06 14:57:54', '2021-03-23 09:40:51'),
	(878, 102, '5', 'Surat', 'Surat', '<ul><li>Arrive Surat.</li></ul>', '1', '2020-04-06 14:57:54', '2021-03-23 09:40:51'),
	(905, NULL, '1', 'Agartala', 'Agra', '<p>asdfsdfsdfsdf</p>', '1', '2020-11-21 10:27:40', '2020-11-21 10:27:40'),
	(906, NULL, '1', 'Agra', 'Agumbe', '<p>sadfasdf</p>', '1', '2020-11-21 10:36:04', '2020-11-21 10:36:04'),
	(913, 98, '1', 'Ahmedabad', 'Mount Abu', '<ul><li>Leave Ahmedabad for Mt.Abu . Arrive Mt.Abu.</li><li>In the evening visit <i><strong>Nakki lake and sunset point.</strong></i></li><li>Dinner and overnight stay at hotel in Mt.Abu.</li></ul>', '1', '2021-01-02 07:31:32', '2021-03-23 09:40:51'),
	(914, 98, '2', 'Mount Abu', 'Mount Abu', '<ul><li>After breakfast &nbsp;<i><strong>trek to Adhar Devi temple and Dilwara Jain temple.</strong></i></li><li>After lunch visit <i><strong>Brahma Kumari World Spiritual Centre ,Trek on Mall road.</strong></i></li><li>Dinner and overnight stay at hotel in Mt. Abu.</li></ul>', '1', '2021-01-02 07:31:32', '2021-03-23 09:40:51'),
	(915, 98, '3', 'Mount Abu', 'Udaipur', '<ul><li>After breakfast &nbsp;leave Mt.Abu for Udaipur. Arrive Udaipur.</li><li>After lunch visit <i><strong>Pratap Memorial, Saheliyonâ€“Kiâ€“Bari, Fateh Sagar Lake.</strong></i></li><li>Dinner and &nbsp;overnight stay at hotel in Udaipur .</li></ul>', '1', '2021-01-02 07:31:32', '2021-03-23 09:40:51'),
	(916, 98, '4', 'Udaipur', 'Ahmedabad', '<ul><li>After breakfast leave Udaipur for Ahmedabad.&nbsp;</li><li>Arrive Ahmedabad.</li></ul>', '1', '2021-01-02 07:31:32', '2021-03-23 09:40:51'),
	(979, 106, '1', 'Chandigarh', 'Delhi', '<ul><li>Late evening leave Chandigarh by Ac bus for Delhi.&nbsp;</li><li>Overnight journey by bus.</li></ul>', '1', '2021-03-30 10:32:58', '2021-03-30 10:32:58'),
	(980, 106, '2', 'Delhi', 'Hyderabad', '<ul><li>Arrive Delhi, transfer to airport and leave Delhi by air for Hyderabad. Arrive Hyderabad.</li><li>After Breakfast visit <i><strong>Birla Mandir, Charminar.</strong></i></li><li>After lunch visit <i><strong>Salarjung Museum, Golconda Fort .Enjoy the &nbsp;light and &nbsp;sound show at Golconda fort.&nbsp;</strong></i></li><li>Dinner and &nbsp;overnight stay at hotel in Hyderabad.</li></ul>', '1', '2021-03-30 10:32:58', '2021-03-30 10:32:58'),
	(981, 106, '3', 'Hyderabad', 'Hyderabad', '<ul><li>After breakfast visit <i><strong>Ramoji Film City, one of the main center for shooting films and serial in India&nbsp;</strong></i></li><li>Dinner and overnight stay at hotel in Hyderabad.</li></ul>', '1', '2021-03-30 10:32:59', '2021-03-30 10:32:59'),
	(982, 106, '4', 'Hyderabad', 'Delhi', '<ul><li>After breakfast leave Hyderabad by air for Delhi. &nbsp;Arrive Delhi, transfer to the AC bus.</li><li>&nbsp;After lunch leave Delhi by Ac bus for Chandigarh.</li></ul>', '1', '2021-03-30 10:32:59', '2021-03-30 10:32:59'),
	(985, 140, '1', 'Delhi', 'Jaipur', '<p>test1</p>', '1', '2021-06-10 06:54:47', '2021-06-10 06:54:47'),
