INSERT INTO `tourprograms` (`id`, `title`, `slug`, `description`, `image`, `alt`, `created_at`, `updated_at`) VALUES
	(12, 'Adventure Tours', NULL, '<p>Shake up your routine and challenge the adventure within. Ramp up your personal fun quotient and experience a rugged new fitness challenge.</p>', '1589519574-5ebe24d6cf3f9webp1614686854301746.webp', '1589519574_5ebe24d6cf3f9.webp', '2020-05-02 10:22:59', '2021-03-02 12:07:35'),
	(13, 'Popular Tours', 'popular-tour', '<p>Gear up to be awe-stuck by the land of fantasy, contrast and fascinating splendor. There is no dearth of stunning beaches, deserts or mountain ranges.</p>', '1589519438-5ebe244e36692webp1614687309853964.webp', '1589519438_5ebe244e36692.webp', '2020-05-02 10:24:30', '2021-03-02 12:15:09'),
	(14, 'Europe', NULL, '<p>From the serenity of Switzerland to the stunning Eiffel tower in Paris, get connected to the histories and cultures of Europe for a lifetime.</p>', '1589519593-5ebe24e9ed480webp161468727158074.webp', '1589519593_5ebe24e9ed480.webp', '2020-05-02 10:25:17', '2021-03-02 12:14:31'),
	(15, 'Asia', NULL, '<p>Explore the desert ruins and mega-malls of the&nbsp;Middle East&nbsp;to the magnificent monuments in&nbsp;South Asia and technology capitals of&nbsp;East Asia.</p>', '1589519583-5ebe24dfa29c5webp161468729485187.webp', '1589519583_5ebe24dfa29c5.webp', '2020-05-02 10:25:57', '2021-03-02 12:14:54'),
	(16, 'USA', NULL, '<p>Traverse the arid deserts in the south, the beautiful pacific coastline in the west, the stunning rocky mountains in the north and spectacular cities in the east.</p>', '1589519617-5ebe2501bf5e9webp1614687213829284.webp', '1589519617_5ebe2501bf5e9.webp', '2020-05-02 10:26:52', '2021-03-02 12:13:33'),
	(17, 'Upcoming Tours', 'upcoming-tour', '<p>Stimulate the craze within you and gear up for more excitement. Get ready to embrace fun and adventure as part of your next getaway.</p>', '1589519605-5ebe24f5299aewebp1614687248820968.webp', '1589519605_5ebe24f5299ae.webp', '2020-05-02 12:29:46', '2021-03-02 12:14:09');
